INSERT INTO `agency` VALUES ('4028816c42b0eca60142b1284007000a', '233网校', '233网校', '430000', '430100', '430105', '资格认证', '1,2,3,4,5,6,7,8,9', '长沙市芙蓉区芙蓉中路二段80号顺天国际财富中心1106室', '4000-800233', '', '长沙二三三网络科技有限公司是国内知名的综合性考试资讯门户网站，全国优秀的网络教育品牌。前身为考试大网站（examda.com），于2005年10月建站，并在2011年全新启用数字域名：<a href=\"http://www.233.com/\" style=\"color: rgb(102, 102, 102); text-decoration: none;\">233.com</a>。其业务涉及考试资讯与辅导、职业教育网络培训、中小学网络教育、在线考试系统研发等多个方面。<a href=\"http://www.233.com/\" style=\"color: rgb(102, 102, 102); text-decoration: none;\">233网校（233.com）</a>旗下包括<a href=\"http://wx.233.com/\" style=\"color: rgb(102, 102, 102); text-decoration: none;\">233网校课程中心（wx.233.com）</a>、<a href=\"http://ks.233.com/\" style=\"color: rgb(102, 102, 102); text-decoration: none;\">233网校在线考试中心(ks.233.com)</a>及<a href=\"http://bbs.233.com/\" style=\"color: rgb(102, 102, 102); text-decoration: none;\">233网校论坛(bbs.233.com)</a>等。</p></li><li><p><a href=\"http://www.233.com/\" style=\"color: rgb(102, 102, 102); text-decoration: none;\">233网校</a>是全国综合性的考试资讯门户网站，网站主要面向社会各阶层的广大考证人群，提供10大类100多种考试的新闻资讯与辅导服务。233网校致力于为广大网友提供一站式考试资讯服务，立足于为广大网友建造一个优质的学习平台，让所有人都能够享受学习、快乐考试。<a href=\"http://wx.233.com/\" style=\"color: rgb(102, 102, 102); text-decoration: none;\">233网校课程中心（wx.233.com）</a>、<a href=\"http://ks.233.com/\" style=\"color: rgb(102, 102, 102); text-decoration: none;\">233网校在线考试中心(ks.233.com)</a>及<a href=\"http://bbs.233.com/\" style=\"color: rgb(102, 102, 102); text-decoration: none;\">233网校论坛(bbs.233.com)</a>都是<a href=\"http://www.233.com/\" style=\"color: rgb(102, 102, 102); text-decoration: none;\">233网校</a>旗下品牌网站。2012年<a href=\"http://www.233.com/\" style=\"color: rgb(102, 102, 102); text-decoration: none;\">233网校</a>全面推出新版会员中心，为会员提供了更优质的互动式在线学习生活体验。几大品牌共同构成了一个独具<a href=\"http://www.233.com/\" style=\"color: rgb(102, 102, 102); text-decoration: none;\">233网校</a>特色的考试王国。</p></li><li><p style=\"text-align:center\"><img src=\"/userfiles/4028816c42b0eca60142b1284007000a/images/1385964407296.png\" style=\"margin: 0px; padding: 0px; border: 0px; vertical-align: top; width: 730px; height: 134px;\" width=\"730\" height=\"134\" border=\"0\" hspace=\"0\" vspace=\"0\" title=\"\"/></p></li><li><p>经过多年的精心经营，前身为考试大网站的<a href=\"http://www.233.com/\" style=\"color: rgb(102, 102, 102); text-decoration: none;\">233网校</a>的发展日趋成熟，用户群稳定增长，备受广大网友的喜爱与推崇。越来越多的网友通过<a href=\"http://www.233.com/\" style=\"color: rgb(102, 102, 102); text-decoration: none;\">233网校</a>实现了人生的跨越。今天，我们将继续坚守自己的教育使命，与旗下品牌网站齐心竭力为中国网络教育界承担和奉献属于教育网站的一份责任与力量！</p></li></ul><p>233网校及产品简介</p><ul style=\"padding: 0px; border: 0px;\" class=\" list-paddingleft-2\"><li><p><a href=\"http://www.233.com/\" style=\"color: rgb(102, 102, 102); text-decoration: none;\">233网校</a>是目前国内最大的网络教育平台之一，网校课程中心成立至今，一直着重打造网校质量与口碑，积极加强师资队伍建设，完善学员服务的渠道，致力于做学员最满意的233品牌网校。</p></li><li><p>233网校开发及拥有的课件范围涉及<strong>公务员</strong>、<strong>财会类</strong>、<strong>外语类</strong>、<strong>外贸类</strong>、<strong>医药类</strong>、<strong>学历类</strong>、<strong>职业资格类</strong>、<strong>计算机类</strong>、<strong>建筑工程类</strong>、<strong>中小学教育</strong>等10大类考试的在线网络培训辅导。长沙二三三网络科技公司拥有<a href=\"http://www.233.com/\" style=\"color: rgb(102, 102, 102); text-decoration: none;\">233网校</a>及旗下所有品牌及产品的所有权。</p></li><li><p style=\"text-align:center\"><img src=\"/userfiles/4028816c42b0eca60142b1284007000a/images/1385964407328.png\" style=\"margin: 0px; padding: 0px; border: 0px; vertical-align: top; width: 730px; height: 242px;\" width=\"730\" height=\"242\" border=\"0\" hspace=\"0\" vspace=\"0\" title=\"\"/></p></li><li><p>目前长沙二三三网络科技有限公司（233网校）<strong>拥有三种为学员服务的渠道：</strong><br/>　　（一）233网校课程中心（<a href=\"http://wx.233.com/\" style=\"color: rgb(102, 102, 102); text-decoration: none;\">wx.233.com</a>）；<br/>　　（二）学习卡代理：目前233网校课程中心在全国各省市区都设有总代，在省会及中小城市也设有销售点，并开发校园代理网点，拥有学习卡销售点上千家。<br/>　　（三）销售合作网站：目前233网校课程中心与上千家网站签订了销售合作协议，学员亦可通过合作网站交纳学费并参加网校的学习。</p></li><li><p style=\"text-align:center\"><img src=\"/userfiles/4028816c42b0eca60142b1284007000a/images/1385964407359.png\" style=\"margin: 0px; padding: 0px; border: 0px; vertical-align: top; width: 730px; height: 204px;\" width=\"730\" height=\"204\" border=\"0\" hspace=\"0\" vspace=\"0\" title=\"\"/></p></li><li><p><strong>233网校师资队伍</strong><br/>　　233网校的师资队伍均是我们精心从全国各地聘请优秀教师，他们具有丰富的从业经验、专业的知识储备和行业较高的知名度。这些优秀教师的加盟，为233网校的师资队伍的整体质量提供了保障，也为广大考生们顺利通过考试提供了充分保证。</p></li></ul><p>公司理念</p><ul style=\"padding: 0px; border: 0px;\" class=\" list-paddingleft-2\"><li><p>理念：我们始终秉承“一切以用户为中心”的发展理念。</p></li><li><p>愿景：以互联网为纽带，帮助每个有志者实现自己的梦想，实现你我共赢。</p></li><li><p>价值观：追求卓越、务实专注、团队协作、守信尽责。</p></li><li><p><img src=\"/userfiles/4028816c42b0eca60142b1284007000a/images/1385964407390.png\" style=\"margin: 0px; padding: 0px; border: 0px; vertical-align: top;\"/>', '2013-12-02 10:34:34', '未审核', '1', '/userfiles/4028816c42b0eca60142b1284007000a/images/logo.gif', null);
INSERT INTO `agency` VALUES ('4028816c42c0dc420142c18ab49b0000', '环球雅思培训学校', '环球雅思隶属于环球天下教育科技集团，环球雅思学校成立于2001年，2006年9月获得软银赛富基金数亿投资组建环球天下教育科技集团（Global Education &amp; Technology Co., Ltd.），并于2010年10月8日在美国成功上市，股票代码为GEDU。2011年11月21日，环球天下教育科技集团（纳斯达克GEDU）与世界级教育领导机构Pearson培生国际教育出版集团（纽交所PSO及伦敦交易所PSN）签署收购协议', '110000', '110100', '110108', '雅思英语培训', '1,2', '北京市朝阳区 朝阳路八里庄西里100号住邦2000商务中心1号楼A802室', '010-62126611', '', '<p><a target=\"_blank\" href=\"http://baike.baidu.com/view/1126172.htm\" style=\"white-space: normal; text-decoration: underline; color: rgb(19, 110, 194); font-size: 36px;\"><span style=\"font-size: 36px;\">环球雅思<span style=\"font-size: 14px;\"></span></span></a></p><p>环球雅思隶属于环球天下教育科技集团，环球雅思学校成立于2001年，2006年9月获得软银赛富基金数亿投资组建环球天下教育科技集团（Global Education &amp; Technology Co., Ltd.），并于2010年10月8日在美国成功上市，股票代码为GEDU。2011年11月21日，环球天下教育科技集团（纳斯达克GEDU）与世界级教育领导机构Pearson培生国际教育出版集团（纽交所PSO及伦敦交易所PSN）签署收购协议，最终Pearson董事会以总价2.94亿美元（约18.67亿人民币）收购环球天下教育，环球从此进入Pearson国际大家庭，这充分体现了环球天下在中国教育行业的领导品牌价值，这一计划将为环球天下未来发展带来强大动力，并进一步孕育着环球天下作为中国民办教育行业代表率先步入国际教育先进级领域。 国内最大英语培训机构之一，被评为全国十大知名学校。每年培训60多万学员，每月开设雅思、托福、外教口语、小语种数万个班级，创立全国第一连锁教学品牌。</p><h2 class=\"headline-1\" style=\"margin: 35px 0px 15px; padding: 0px; font-size: 24px; font-family: 微软雅黑, 黑体, Verdana; font-weight: 500; line-height: 22px; clear: both; zoom: 1; position: relative; left: -30px;\"><a style=\"color: rgb(19, 110, 194); position: absolute; top: -50px; display: block;\" name=\"1\"></a><a style=\"color: rgb(19, 110, 194); position: absolute; top: -50px; display: block;\" name=\"sub1126172_1\"></a></h2><p><a target=\"_blank\" href=\"http://baike.baidu.com/view/1126172.htm\" style=\"text-decoration: none; color: rgb(19, 110, 194);\">环球雅思</a>（Global Education &amp; Technology Co.,Ltd.），2010年10月8日在美国纳斯达克成功上市，股票代码GEDU。拥有在119个城市从事<a target=\"_blank\" href=\"http://baike.baidu.com/view/127315.htm\" style=\"text-decoration: none; color: rgb(19, 110, 194);\">外语</a>和职业教育培训的连锁学校351家、156所环球灵童少儿英语连锁学校、25所倍趣科学儿童学苑和疯狂家族儿童俱乐部、从事在线教育的环球职业网校与环球英语网校、</p><p><a hidefocus=\"true\" class=\"nslog:1199\" href=\"http://baike.baidu.com/picview/1126172/1126172/0/e865a699f431e7566e068cb4.html\" target=\"_blank\" style=\"text-decoration: none; color: rgb(19, 110, 194); height: 218px; width: 220px; display: block; position: relative;\"><img class=\"editorImg  log-set-param\" log-set-param=\"img_view\" alt=\"环球雅思学校\" title=\"环球雅思学校\" height=\"218\" width=\"220\" src=\"/userfiles/4028816c42c0dc420142c18ab49b0000/images/1386467413703.jpg\" style=\"border: 0px; display: block;\"/></a></p><p class=\"pic-info\" style=\"margin-top: 0px; margin-bottom: 0px; padding: 8px 0px 8px 7px; color: rgb(85, 85, 85); font-size: 12px; font-family: 宋体; word-wrap: break-word; word-break: break-all; line-height: 15px; min-height: 12px; border-width: 0px 1px 1px; border-right-style: solid; border-left-style: solid; border-right-color: rgb(224, 224, 224); border-left-color: rgb(224, 224, 224); border-bottom-style: solid; border-bottom-color: rgb(204, 204, 204); zoom: 1; cursor: pointer;\">环球雅思学校</p><p>从事出国咨询的五湖中视留学公司（环球雅思<a target=\"_blank\" href=\"http://baike.baidu.com/view/2841430.htm\" style=\"text-decoration: none; color: rgb(19, 110, 194);\">留学服务</a>）国家特许资质单位及10个城市环球雅思留学服务分中心、4所容纳千人的环球国际封闭寄宿学院、12所凯育多语种学习中心、从事图书教材出版的环球卓尔英才公司、从事教学研发的环球教学研究中心GTRC等数十家专业教育机构。</p><p>2011年11月21日，环球天下教育科技集团（纳斯达克GEDU）与世界级教育领导机构Pearson培生国际教育集团（纽交所PSO及伦敦交易所PSN）签署收购协议。</p><p>2005年9月受到教育部部长和陈香梅科教文奖的表彰。</p><p>10年驰名独特的“环球雅思实用应试教学模式”。</p><p>连锁建校 全国第一</p><p><a target=\"_blank\" href=\"http://baike.baidu.com/view/1126172.htm\" style=\"text-decoration: none; color: rgb(19, 110, 194);\">环球雅思</a>各项课程以权威、实效、精炼着称，总部设在<a target=\"_blank\" href=\"http://baike.baidu.com/view/2621.htm\" style=\"text-decoration: none; color: rgb(19, 110, 194);\">北京</a>，并在各地建立了<a target=\"_blank\" href=\"http://baike.baidu.com/view/1735.htm\" style=\"text-decoration: none; color: rgb(19, 110, 194);\">上海</a>、广州、深圳、重庆、<a target=\"_blank\" href=\"http://baike.baidu.com/view/2585.htm\" style=\"text-decoration: none; color: rgb(19, 110, 194);\">成都</a>、<a target=\"_blank\" href=\"http://baike.baidu.com/view/2155.htm\" style=\"text-decoration: none; color: rgb(19, 110, 194);\">西安</a>、<a target=\"_blank\" href=\"http://baike.baidu.com/view/2828.htm\" style=\"text-decoration: none; color: rgb(19, 110, 194);\">天津</a>、<a target=\"_blank\" href=\"http://baike.baidu.com/view/3742.htm\" style=\"text-decoration: none; color: rgb(19, 110, 194);\">杭州</a>、温州、扬州、无锡、苏州、长沙、<a target=\"_blank\" href=\"http://baike.baidu.com/view/5567.htm\" style=\"text-decoration: none; color: rgb(19, 110, 194);\">哈尔滨</a>、济南、青岛、郑州、大连、武汉、南京、太原、沈阳、福州、合肥、海口、贵阳、石家庄、邯郸、兰州、台州、聊城、银川、海外澳洲、台湾等351个分校，每年培训60多万学员人次，每年开设雅思、托福、外教口语数万个班级，创立全国第一连锁教学品牌，经数据比较环球雅思学员占考生比例高达78%之多。</p><p>专注留学语言培训</p><p><a target=\"_blank\" href=\"http://baike.baidu.com/view/1126172.htm\" style=\"text-decoration: none; color: rgb(19, 110, 194);\">环球雅思</a>15年专注出国留学语言培训，在全国100多个城市，拥有500多家校区，10000多名优秀教师，已成功培训500多万学员，旨为学员提供一站式留学语言培训服务.</p><h2 class=\"headline-1\" style=\"margin: 35px 0px 15px; padding: 0px; font-size: 24px; font-family: 微软雅黑, 黑体, Verdana; font-weight: 500; line-height: 22px; clear: both; zoom: 1; position: relative; left: -30px;\"><span class=\"headline-1-index\" style=\"width: 26px; height: 25px; color: rgb(204, 204, 204); line-height: 25px; text-align: right; font-size: 20px; display: block; float: left; margin-right: 6px;\">2</span><a style=\"color: rgb(19, 110, 194); position: absolute; top: -50px; display: block;\" name=\"2\"></a><a style=\"color: rgb(19, 110, 194); position: absolute; top: -50px; display: block;\" name=\"sub1126172_2\"></a><span style=\"line-height: 24px;\">特点</span></h2><p><strong>品牌卓着 成就辉煌</strong></p><p>麾下有“<a target=\"_blank\" href=\"http://baike.baidu.com/view/1126172.htm\" style=\"text-decoration: none; color: rgb(19, 110, 194);\">环球雅思</a>”“环球新托福”出国应试，“环球灵童”少儿品牌。培训成绩骄人辉煌，环球连锁学校提供500位专家名师讲授的“雅思36大系列出国课程”和多种高分实力承诺，环球<a target=\"_blank\" href=\"http://baike.baidu.com/view/131138.htm\" style=\"text-decoration: none; color: rgb(19, 110, 194);\">新托福</a>精品100分，以全国规模、卓越教学成为学员通过考试的信誉保证，许多海外学员慕名回国参加环球培训。<a target=\"_blank\" href=\"http://baike.baidu.com/view/3483488.htm\" style=\"text-decoration: none; color: rgb(19, 110, 194);\">基础英语</a>、商务英语、外教口语和在线教育更闪耀辉煌，拥有“背诵”新概念英语、“大声会”外教口语俱乐部、“环球BEC”商务英语、“环球本土留洋”<a target=\"_blank\" href=\"http://baike.baidu.com/view/1662179.htm\" style=\"text-decoration: none; color: rgb(19, 110, 194);\">英语夏令营</a>、“凯育”多语种、“易学” “博雅”“博思”中小学同步辅导等新势力品牌。全面领先的面授和在线课程助海内外学子以优异成绩走向社会、步入外企、成功留学移民。</p><p><strong>政府企培 大学合作</strong></p><p><a target=\"_blank\" href=\"http://baike.baidu.com/view/1126172.htm\" style=\"text-decoration: none; color: rgb(19, 110, 194);\">环球雅思</a>为政府机关和国内外企业特制量化标准的“A+”方案，赢得众多企事业单位、中外办学及海外奖学金申请项目的追崇青睐。北京奥运城管培训项目、家乐福、微软、松下、联想、财政部、北京残联、税务总局、人保、卫生局等数百家单位选择环球英语优化企业；清华、北大、人大、农大、中央美院、财大、政法等全国近80%的大学中外国际学院选择与<a target=\"_blank\" href=\"http://baike.baidu.com/view/1126172.htm\" style=\"text-decoration: none; color: rgb(19, 110, 194);\">环球雅思</a>合作教学，确保雅思托福100%通过。</p><p><strong>巅峰师资 行业领军</strong></p><p>环球雅思拥有国内巅峰师资，“环球雅思教学研究中心GTRC”汇聚各地名师，多年来造就雅思、托福、<a target=\"_blank\" href=\"http://baike.baidu.com/view/95395.htm\" style=\"text-decoration: none; color: rgb(19, 110, 194);\">SAT</a>、口语、少儿英语等教学精英无数,“雅思第一人”“口语王”“<a target=\"_blank\" href=\"http://baike.baidu.com/view/24803.htm\" style=\"text-decoration: none; color: rgb(19, 110, 194);\">五虎将</a>”“阳光明星教师”们帮助全国学员突破考试；更聘请现任考官支持，让学生日行千里。南北环球雅思学校老师专利性独创“平行阅读法”“无词阅读法”“双向听力法”“807词法”“装配写作法”“机经音频法”等数十种环球教学法，实用精炼。</p><p><strong>十年辉煌 骄人数据</strong></p><p>10年间<a target=\"_blank\" href=\"http://baike.baidu.com/view/1126172.htm\" style=\"text-decoration: none; color: rgb(19, 110, 194);\">环球雅思</a>开发了影响中国雅思教学培训十代课程体系，开创雅思各项满分第一名最多记录，1997年11月环球学员获得全国第一个听力满分；2006年7月13岁的钟琬婷考取三个9分全国第一成绩，12月彭智更创双9双8分新冠军奇迹，成为“环球雅思学习使者”。约3000余名学员获得8分以上成绩，环球雅思高分奖学金颁发超过80万元。在全国<a target=\"_blank\" href=\"http://baike.baidu.com/view/1944.htm\" style=\"text-decoration: none; color: rgb(19, 110, 194);\">雅思</a>考场中80%高分学员出自各地环球学校。课程逐年更新升级，首创雅思7分班，剑桥真题解密班，VIP一对一雅思·托福私人课程更独领风骚。</p><p><strong>专业专心 服务贴心</strong></p><p>环球雅思不断优化学员学习和考试服务，提供完整个性化培训、考试设计、免费入学前测试、代报考、私人补课等，帮你在数百种课程间选择最实效、经济、保险的课程，提供<a target=\"_blank\" href=\"http://baike.baidu.com/view/1944.htm\" style=\"text-decoration: none; color: rgb(19, 110, 194);\">雅思</a>、<a target=\"_blank\" href=\"http://baike.baidu.com/view/1324.htm\" style=\"text-decoration: none; color: rgb(19, 110, 194);\">托福</a>、<a target=\"_blank\" href=\"http://baike.baidu.com/view/53791.htm\" style=\"text-decoration: none; color: rgb(19, 110, 194);\">BEC</a>、<a target=\"_blank\" href=\"http://baike.baidu.com/view/606849.htm\" style=\"text-decoration: none; color: rgb(19, 110, 194);\">四六级</a>、<a target=\"_blank\" href=\"http://baike.baidu.com/view/503561.htm\" style=\"text-decoration: none; color: rgb(19, 110, 194);\">BETS</a>考试的代报名和查分复议服务。轰动全国“保签直通班” “环球留学规划院”环球雅思留学服务中心运用9年经验提供最佳留学途径。学术写作中心为留学生提供一流文书写作服务，并和北京公证处联办公证。</p><p><strong>满载荣誉 国际授权</strong></p><p><a target=\"_blank\" href=\"http://baike.baidu.com/view/1126172.htm\" style=\"text-decoration: none; color: rgb(19, 110, 194);\">环球雅思</a>荣获“全国十大知名学校”等众多最高荣誉，多次得到教育部部长、原国际奥委会主席萨马兰奇、北京市长、陈香梅女士鼓励和光临指导；被评为中国连锁协会优秀管理者称号；年度中国英语领军人物，是公认的英式教育和全国出国考试最具规模连锁机构、外教口语连锁基地；国家外籍专家聘请单位[1113120号]；麾下环球职业在线多次荣获全国“十佳网络教育机构”。</p><p><strong>图书出版 教学引航</strong></p><p>环球雅思图书事业公司携手旗下百位名师与朗文、麦克米伦、剑桥、外文、高教等国际国内大型出版社合作雅思、口语、新概念、BEC、多语种、职业英语教材多达百册。16大系列百册雅思图书位居全国之首，词汇小伴侣再版重印达10次，销量几十万本。</p><p><br/></p>', '2013-12-05 14:56:02', '审核通过', '1', '/userfiles/4028816c42c0dc420142c18ab49b0000/images/logo.jpg', null);
INSERT INTO `agency` VALUES ('4028816c42fe72200142fe858ed70000', '优异网校', '法规、经济、管理+实务（建筑/机电/市政/公路/水利/通信/矿业）四科全程VIP班。2013年VIP班全面招生，现在报名独享超长学习时间！配套高质量章节练习，模拟试题历年真题，专业名师答疑！）考试不过2014年免费重学', '110000', '110100', '110102', '资格认证', '5', '北京长沙畅亨信息技术', '18900707696', '18900707696', '<p>法规、经济、管理+实务（建筑/机电/市政/公路/水利/通信/矿业）四科全程VIP班。2013年VIP班全面招生，现在报名独享超长学习时间！配套高质量章节练习，模拟试题历年真题，专业名师答疑！）考试不过2014年免费重学</p>', '2013-12-17 11:07:15', '12121212', '1', '', null);
