INSERT INTO `agency_course` VALUES ('4028816c42ac4b5b0142acfdbb860001', '会计从业', '5', '1', '4028816c42b0eca60142b1284007000a', '2013-12-01 15:09:39', '0', null, null, '/userfiles/4028816c407fbf9e01407fc2f5320000/flash/bkaovAYt-1753142.mp4', null, '<p>全科VIP班由该考试基础+所报专业科目的精讲班、冲刺班、习题班、考点预测班、应试技巧班、模考押题班等班别组合而成，适用于任何学习阶段的学员。该班级通过对教材知识系统详细地讲解、考纲及重点难点的分析、历年真题及模拟题的深度解析、复习方法及考试技巧的介绍等教学内容，使学员全面掌握考试，最后会配有主讲老师的两套预测题供学员练习参考。课程有效期：2014年考试结束后关闭（有效期暂以2013年为准）</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; font-size: 12px; list-style: none; color: rgb(51, 51, 51); font-family: Arial; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\">2014年班级参考2013年班级进行设置，2014年新版课程会根据教材变化及学员反馈情况进行更新课程，保留或更改班级设置、课时及授课老师。</p><p><br/></p><p></p>', '500', '400', null, '2013-12-09 09:03:48', '已通过', '0', null, '/userfiles/4028816c42b0eca60142b1284007000a/images/jg1.jpg', '4028816c42b221ab0142b22e9c260001', null, '100', '1', '全科VIP班由该考试基础+所报专业科目的精讲班、冲刺班、习题班、考点预测班、应试技巧班、模考押题班等班别组合而成，适用于任何学习阶段的学员。该班级通过对教材知识系统详细地讲解、考纲及重点难点的分析、历年真题及模拟题的深度解析、复习方法及考试技巧的介绍等教学内容，使学员全面掌握考试，最后会配有主讲老师的两套预测题供学员练习参考。课程有效期：2014年考试结束后关闭（有效期暂以2013年为准', '10', null, null, null);
INSERT INTO `agency_course` VALUES ('4028816c42c66c880142c6759a700000', '7分冲刺班', '10', '0', '4028816c42c0dc420142c18ab49b0000', '2013-12-06 13:51:05', '0', '110100', '09：00-18：00', '/userfiles/4028816c42c0dc420142c18ab49b0000/flash/1895233.flv', '平和堂校区', '<p style=\"border-width: 0px; padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 12px; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"margin: 0px; padding: 0px; color: rgb(204, 0, 0); font-size: 14px; display: block;\"><strong style=\"margin: 0px; padding: 0px;\">课程介绍</strong></span></p><p><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 12px; line-height: 24px;  background-color: rgb(255, 255, 255);\">雅思7分冲刺班（白班、晚班、周末班）</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 12px; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 12px; line-height: 24px;  background-color: rgb(255, 255, 255);\">招生对象：通过环球入学测试或一年内雅思均分已达5.5分的考生；大学英语六级530分以上的考生；申请国外一流名校，法律、MBA、信息、生物学等热门专业的学生。&nbsp;</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 12px; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 12px; line-height: 24px;  background-color: rgb(255, 255, 255);\">教学承诺：报名学员通过“环球测试组”设立的免费入学测试，半年内未满均分7分缴纳600元手续费可重读（缺课两次以上学员不予保分）。</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 12px; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 12px; line-height: 24px;  background-color: rgb(255, 255, 255);\">课程内容：听力9次；口语10次；（考官和口语技巧老师联授）；写作9次；阅读9次；含听读写全科模拟考试1次；一对一模拟Interview 1次；</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 12px; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 12px; line-height: 24px;  background-color: rgb(255, 255, 255);\">师资力量：环球雅思金牌名师坐镇。听力教师；阅读教师，写作教师，IELTS口语历任考官（外籍）；IELTS口语技巧教师（中教）</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 12px; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 12px; line-height: 24px;  background-color: rgb(255, 255, 255);\">教材内容：环球内部教材</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 12px; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 12px; line-height: 24px;  background-color: rgb(255, 255, 255);\">课&nbsp;&nbsp;&nbsp; 时：168课时</span></p><p><br/></p>', '3980', '3980', '2014-01-06 13:44:29', '2014-02-24 14:12:06', '审核中....', '0', null, '/userfiles/4028816c42c0dc420142c18ab49b0000/images/SOR090312000001.jpg', '', null, '0', '2', '招生对象：通过环球入学测试或一年内雅思均分已达5.5分的考生；大学英语六级530分以上的考生；申请国外一流名校，法律、MBA、信息、生物学等热门专业的学生。 \r\n教学承诺：报名学员通过&ldquo;环球测试组&rdquo;设立的免费入学测试，半年内未满均分7分缴纳600元手续费可重读（缺课两次以上学员不予保分）', '0', null, null, null);
INSERT INTO `agency_course` VALUES ('4028816c42c66c880142c67776060001', '6分长期基础班', '10', '0', '4028816c42c0dc420142c18ab49b0000', '2013-12-06 13:53:07', '0', '110100', '09：00-18：00', '/userfiles/4028816c42c0dc420142c18ab49b0000/flash/1895233.flv', '平和堂校区', '<p style=\"border-width: 0px; padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 12px; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"margin: 0px; padding: 0px; color: rgb(204, 0, 0); font-size: 14px; display: block;\"><strong style=\"margin: 0px; padding: 0px;\">课程介绍</strong></span></p><p><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 12px; line-height: 24px;  background-color: rgb(255, 255, 255);\">6分长期基础班</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 12px; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 12px; line-height: 24px;  background-color: rgb(255, 255, 255);\">招生对象：英语基础较好的高中生，未达到大学英语四级水平的学生或自学时间较少，需要更多课时来准备雅思考试的学员，词汇量在3000左右，掌握初级语法。&nbsp;</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 12px; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 12px; line-height: 24px;  background-color: rgb(255, 255, 255);\">教学承诺：报名学员通过“环球测试组”设立的免费入学测试，半年内未满均分6分缴纳600元手续费可重读雅思6.5突破班一期（缺课两次以上学员不予保分）。</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 12px; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 12px; line-height: 24px;  background-color: rgb(255, 255, 255);\">教学特色：无间断课程，小班教学，环球所创“复合班”科学教学法，基于环球具备庞大的师资和每月众多课程，力图突破传统的“一师到底”单一教学制，课程复杂严谨无间隙，吸纳不同优秀老师风格，不断激起和保持学生学习兴趣，特别适合长时段学习的学生。</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 12px; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 12px; line-height: 24px;  background-color: rgb(255, 255, 255);\">授课内容： 第一阶段：&nbsp;&nbsp; 预备听力：10次（4课时/次）</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 12px; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 12px; line-height: 24px;  background-color: rgb(255, 255, 255);\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;预备口语：10次（4课时/次）</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 12px; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 12px; line-height: 24px;  background-color: rgb(255, 255, 255);\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;预备阅读：10次（4课时/次）</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 12px; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 12px; line-height: 24px;  background-color: rgb(255, 255, 255);\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;预备写作：10次（4课时/次）</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 12px; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 12px; line-height: 24px;  background-color: rgb(255, 255, 255);\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 第二阶段：&nbsp;&nbsp;&nbsp; 雅思6.5分强化课程</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 12px; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 12px; line-height: 24px;  background-color: rgb(255, 255, 255);\">总课时： 364课时</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 12px; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体; font-size: 12px; line-height: 24px;  background-color: rgb(255, 255, 255);\">教&nbsp;&nbsp;&nbsp; 材：环球内部教材</span></p><p><br/></p>', '7280', '7280', '2014-01-06 13:52:37', '2013-12-06 15:55:00', '审核中....', '1', null, '/userfiles/4028816c42c0dc420142c18ab49b0000/images/SOR090312000001.jpg', '', null, '0', '0', '招生对象：英语基础较好的高中生，未达到大学英语四级水平的学生或自学时间较少，需要更多课时来准备雅思考试的学员，词汇量在3000左右，掌握初级语法。 \r\n教学承诺：报名学员通过&ldquo;环球测试组&rdquo;设立的免费入学测试，半年内未满均分6分缴纳600元手续费可重读雅思6.5突破班一期（缺课两次以上学员不予保分）', '0', null, null, null);
INSERT INTO `agency_course` VALUES ('4028816c42c66c880142c67d8a3c0002', '铂金雅思6.5分突破班', '10', '0', '4028816c42c0dc420142c18ab49b0000', '2013-12-06 13:59:45', '0', '110100', '09：00-18：00', '/userfiles/4028816c42c0dc420142c18ab49b0000/flash/1895233.flv', '平和堂校区', '<p style=\"border-width: 0px; padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 12px; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"margin: 0px; padding: 0px; color: rgb(204, 0, 0); font-size: 14px; display: block;\"><strong style=\"margin: 0px; padding: 0px;\">课程介绍</strong></span></p><p>招生对象：&nbsp;&nbsp;&nbsp; 大学英语4-6级或取得雅思成绩5.5分以上成绩，英语基础一般，对雅思成绩有较高要求，欲在短周期内提高成绩的学员。<br/>课程特点：&nbsp;&nbsp;&nbsp; 为敲开海外名校大门，雅思6.5-7分是必备敲门砖。目标更高的高分班应运而生，严格的入学关，质量精细的拔高训练，助学生勇攀雅思高分。第一步：提升高分技巧，在学习完雅思6.5分突破班的基础上，将由长沙地区著名的雅思教学专家为您量身定制听、说、写四项个性应考冲刺方案，享受听说读写各专项名师的一对一辅导，量身制定考前复习计划，打造私人专享的雅思空间。第二步：网上名师点题冲刺班，精心总结最新真题，解释考题变化真相，理清高分应试命脉，考题点睛，助考生一臂之力。全面讲解雅思真题题库，听说读写解题技巧，全面突击强化。<br/>课程内容：第一阶段：雅思6.5分突破班<br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 第二阶段：听说读写名师VIP一对一，8小时（结课之前提前一周预定，根据学生安排课程自主选择）<br/>课 时：108课时+8VIP&nbsp;<br/>学费：5480元</p><p><br/></p>', '5480', '5480', '2014-01-16 13:59:00', '2013-12-06 15:54:44', '审核中....', '1', null, '/userfiles/4028816c42c0dc420142c18ab49b0000/images/SOR090312000001.jpg', '', null, '0', '0', '课程介绍招生对象： 大学英语4-6级或取得雅思成绩5.5分以上成绩，英语基础一般，对雅思成绩有较高要求，欲在短周期内提高成绩的学员。课程特点：  为敲开海外名校大门，雅思6.5-7分是必备敲门砖。', '0', null, null, null);
INSERT INTO `agency_course` VALUES ('4028816c42c66c880142c67eecca0003', '托福考前精讲班', '4028816c40a002bf0140a00361f80009', '0', '4028816c42c0dc420142c18ab49b0000', '2013-12-06 14:01:16', '0', '110100', '09:00-18:00', '/userfiles/4028816c42c0dc420142c18ab49b0000/flash/1895233.flv', '平和堂校区', '<p style=\"border-width: 0px; padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 12px; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"margin: 0px; padding: 0px; color: rgb(204, 0, 0); font-size: 14px; display: block;\"><strong style=\"margin: 0px; padding: 0px;\">课程介绍</strong></span></p><p><strong style=\"margin: 0px; padding: 0px;\">课程特色</strong>：采用最新真题训练，对考试趋势全面预测和技巧延伸。&nbsp;&nbsp;&nbsp;<br/><strong style=\"margin: 0px; padding: 0px;\">针对学员</strong>：已参加过新托福强化段课程或已经参加过托福考试的学员，对机考不熟悉或者近期即将参加考试的学员（配合托福强化段学习效果更佳）。&nbsp;&nbsp;&nbsp;&nbsp;</p><p><strong style=\"margin: 0px; padding: 0px;\">培训内容</strong>：全真模考，对阅读，听力，口语，写作进行串讲，精确把控考试趋势和应试技巧。&nbsp;<strong style=\"margin: 0px; padding: 0px;\">授课教材</strong>：《托福官方指南》、TPO以及北美考试院独家研发材料、模拟试题、全真模考题与精解<br/><strong style=\"margin: 0px; padding: 0px;\">班级人数</strong>：精品2-6人班<br/><strong style=\"margin: 0px; padding: 0px;\">培训费用</strong>：7600元（具体课程优惠请详询分校课程顾问）<br/><strong style=\"margin: 0px; padding: 0px;\">课程时间</strong>：64课时</p><p><br/></p>', '7600', '7600', '2014-01-06 14:00:40', '2013-12-06 15:54:14', '审核中....', '1', null, '/userfiles/4028816c42c0dc420142c18ab49b0000/images/SOR090312000001.jpg', '', null, '0', '0', '课程介绍课程特色：采用最新真题训练，对考试趋势全面预测和技巧延伸。   针对学员：已参加过新托福强化段课程或已经参加过托福考试的学员，对机考不熟悉或者近期即将参加考试的学员（配合托福强化段学习效果更佳）', '0', null, null, null);
INSERT INTO `agency_course` VALUES ('4028816c42c66c880142c680374b0004', 'GRE精品班', '4028816c40a002bf0140a003618b0007', '0', '4028816c42c0dc420142c18ab49b0000', '2013-12-06 14:02:40', '0', '110100', '09:00-18:00', '/userfiles/4028816c42c0dc420142c18ab49b0000/flash/1895233.flv', '平和堂校区', '<p>GRE精品班</p><p style=\"border-width: 0px; padding: 0px; margin-top: 0px; margin-bottom: 0px;\"><span style=\"margin: 0px; padding: 0px; color: rgb(204, 0, 0); font-size: 14px; display: block;\"><strong style=\"margin: 0px; padding: 0px;\">课程介绍</strong></span></p><p><strong style=\"margin: 0px; padding: 0px;\">招生对象：</strong>专为希望得到个性化教学服务、全面掌握GRE考试精华的学员<br/><strong style=\"margin: 0px; padding: 0px;\">教学承诺：</strong>2-6人个性化授课，经过入学测试，合格录取。<br/><strong style=\"margin: 0px; padding: 0px;\">课程设计：</strong>从阅读、填空、作文、数学等方面进行全面、系统的知识点讲解及应试技巧，提高学生的应试能力。&nbsp;<br/><strong style=\"margin: 0px; padding: 0px;\">课程时间：</strong>120课时&nbsp;&nbsp;&nbsp;<br/><strong style=\"margin: 0px; padding: 0px;\">培训费用：</strong>16800元</p><p><br/></p>', '16800', '16800', '2014-01-06 14:02:13', '2013-12-06 15:52:45', '审核中....', '1', null, '/userfiles/4028816c42c0dc420142c18ab49b0000/images/SOR090312000001.jpg', '', null, '0', '0', '课程介绍招生对象：专为希望得到个性化教学服务、全面掌握GRE考试精华的学员教学承诺：2-6人个性化授课，经过入学测试，合格录取。课程设计：从阅读、填空、作文、数学等方面进行全面、系统的知识点讲解及应试技巧，提高学生的应试能力。', '0', null, null, null);
INSERT INTO `agency_course` VALUES ('4028816c42c66c880142c681fb330005', 'SAT精品基础班', '4028816c40a002bf0140a00361f80009', '0', '4028816c42c0dc420142c18ab49b0000', '2013-12-06 14:04:36', '0', '110100', '09:00-18:00', '/userfiles/4028816c42c0dc420142c18ab49b0000/flash/1895233.flv', '平和堂校区', '<p style=\"border-width: 0px; padding: 0px; margin-top: 0px; margin-bottom: 0px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 12px; line-height: 24px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"margin: 0px; padding: 0px; color: rgb(204, 0, 0); font-size: 14px; display: block;\"><strong style=\"margin: 0px; padding: 0px;\">课程介绍</strong></span></p><p><strong style=\"margin: 0px; padding: 0px;\">课程特色：</strong>系统讲解与实战训练相结合，通过海量的基础训练，不断地发现学员在SAT考试中的薄弱地方，有针对性的进行难点精讲，从而使学员在短时间内突飞猛进。</p><p><strong style=\"margin: 0px; padding: 0px;\">针对学员：</strong>没有SAT培训经验或托福低于75分的初、高中学生</p><p><strong style=\"margin: 0px; padding: 0px;\">培训内容：</strong>节省学生学习流程，系统一次性学习SAT课程，目标是获得考试高分、冲刺美国名校</p><p><strong style=\"margin: 0px; padding: 0px;\">赠送服务：</strong>教学督导跟进学习情况，定期向家长反馈学习情况提供个性化的学习计划不定时提供最新的备考材料,提供课后自习室,提供免费报考协助（鉴于托福报考的难度以及不确定性，不保证在规定的时间内能帮考生刷到考位）报读其他课程时，享受最低85折优惠（仅限一年之内，仅限个人使用）<br/><strong style=\"margin: 0px; padding: 0px;\">班级人数：</strong>精品2-6人班授课教材：《Oline Course》、《SAT历年考试真题》、环球雅思内部讲义</p><p><strong style=\"margin: 0px; padding: 0px;\">培训费用</strong>：21600元（具体课程优惠请详询分校课程顾问）<br/><strong style=\"margin: 0px; padding: 0px;\">课程时间：</strong>230课时</p><p><br/></p>', '21600', '21600', '2014-01-06 14:03:47', '2013-12-06 15:52:07', '审核中....', '1', null, '/userfiles/4028816c42c0dc420142c18ab49b0000/images/SOR090312000001.jpg', '', null, '0', '0', '课程特色：系统讲解与实战训练相结合，通过海量的基础训练，不断地发现学员在SAT考试中的薄弱地方，有针对性的进行难点精讲，从而使学员在短时间内突飞猛进。', '0', null, null, null);
INSERT INTO `agency_course` VALUES ('4028816c42c66c880142c68442640006', '四级强化精品班', '4028816c40a002bf0140a00360240002', '0', '4028816c42c0dc420142c18ab49b0000', '2013-12-06 14:07:05', '0', '110100', '每天9：00-11：30 13：00-18：10', '/userfiles/4028816c42c0dc420142c18ab49b0000/flash/1895233.flv', '环球雅思-魏公村校区', '<p>四级强化精品班</p><p style=\"border-width: 0px; padding: 0px; margin-top: 0px; margin-bottom: 0px;\"><span style=\"margin: 0px; padding: 0px; color: rgb(204, 0, 0); font-size: 14px; display: block;\"><strong style=\"margin: 0px; padding: 0px;\">课程介绍</strong></span></p><p><span style=\"margin: 0px; padding: 0px;\">&quot;适合学员：1、英语有一定的基础的学员高考分数超过100分以上的考生；<br/>2、适用于已经进行四级或六级考试系统的词汇背诵和已经开始系统复习四级或六级考试的学员；<br/>3、想快速提高四级或六级考试应考能力，掌握考试技巧和高分要领的学员；<br/>4、希望快速高效提分的学员，环球雅思老学员。<br/>课程特色：根据2013年新大纲，强化课程可以帮助学员通过历年真题总结考试规律，掌握考试技巧；冲刺课程掌握最为实用的解题思路和技巧，高效提高分数；模考课程为考生冲刺做最后助推。考前预测点题课程主要精准预测考试范围和作文题目。&quot;</span></p><p><br/></p>', '780', '780', '2014-01-18 14:06:29', '2013-12-06 15:51:41', '审核中....', '1', null, '/userfiles/4028816c42c0dc420142c18ab49b0000/images/SOR090312000001.jpg', '', null, '0', '0', '课程特色：根据2013年新大纲，强化课程可以帮助学员通过历年真题总结考试规律，掌握考试技巧；冲刺课程掌握最为实用的解题思路和技巧，高效提高分数；模考课程为考生冲刺做最后助推。考前预测点题课程主要精准预测考试范围和作文题目', '0', null, null, null);
