INSERT INTO `agency_course` VALUES ('4028816c42d4dd790142d4ea89960001', '全科VIP保过班(建筑工程+三门公共课)', '5', '1', '4028816c42b0eca60142b1284007000a', '2013-12-09 09:13:29', '0', '', null, '/userfiles/4028816c42b0eca60142b1284007000a/flash/gaoqing1.mp4', null, '<p style=\"margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; font-size: 12px; list-style: none; color: rgb(51, 51, 51); font-family: Arial; line-height: 23.99147605895996px; white-space: normal; background-color: rgb(255, 255, 255);\">全科VIP班由该考试基础+所报专业科目的精讲班、冲刺班、习题班、考点预测班、应试技巧班、模考押题班等班别组合而成，适用于任何学习阶段的学员。该班级通过对教材知识系统详细地讲解、考纲及重点难点的分析、历年真题及模拟题的深度解析、复习方法及考试技巧的介绍等教学内容，使学员全面掌握考试，最后会配有主讲老师的两套预测题供学员练习参考。课程有效期：2014年考试结束后关闭（有效期暂以2013年为准）</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; font-size: 12px; list-style: none; color: rgb(51, 51, 51); font-family: Arial; line-height: 23.99147605895996px; white-space: normal; background-color: rgb(255, 255, 255);\">2014年班级参考2013年班级进行设置，2014年新版课程会根据教材变化及学员反馈情况进行更新课程，保留或更改班级设置、课时及授课老师。</p><p><br/></p>', '4800', '2100', null, '2013-12-09 09:28:31', '审核中....', '1', null, '/userfiles/4028816c42b0eca60142b1284007000a/images/20130609142035813581.jpg', '4028816c42b221ab0142b22e9c260001', null, '0', '0', '全科VIP班由该考试基础+所报专业科目的精讲班、冲刺班、习题班、考点预测班、应试技巧班、模考押题班等班别组合而成，适用于任何学习阶段的学员。该班级通过对教材知识系统详细地讲解、考纲及重点难点的分析、历年真题及模拟题的深度解析', '80', null, null, null);
