INSERT INTO `agency_course` VALUES ('4028816c445260d00144528b931d000a', '100天高分状元方案（省市机关）', '9', '1', '4028816c445260d0014452778a730003', '2014-02-21 11:44:42', '0', '', null, '', null, '<p>本课程是华图顶级名师集体潜心研究近十年本地公考命题规律与考试趋势，精心设计高端课程，具体包含《名师模块班》《高分技巧班》《历年真题详解班》《必考点习题详解班》《80分申论批改班》《冲刺密卷》等，3个月轻松圆您“状元”梦绝不是一句广告词，从现在开始，从华图起步，采用高效的学习方法和科学的学习规划，打牢基础、巩固优势、提高劣势，把握时机。<br/><br/>通过系统学习，掌握行测与申论的各类题型命题规律与趋势，知识点的各种解题方法，并熟练掌握各类题型的“秒杀技巧”，让您行测轻松突破75分，申论轻松突破65分。</p><table align=\"center\" width=\"800\"><tbody><tr><th colspan=\"5\" scope=\"col\">100天高分状元方案</th></tr><tr><td rowspan=\"15\" width=\"58\"><p>方案内容</p></td><td colspan=\"2\"><p>方案设置</p></td><td width=\"150\"><p>数量</p></td><td width=\"402\"><p>学习说明</p></td></tr><tr><td colspan=\"2\"><p>习题自测</p></td><td><p>230道</p></td><td><p>每讲课前有1-3道自测题；<br/>须自测，检测自己水平。</p></td></tr><tr><td rowspan=\"2\" width=\"74\"><p>理论学习</p></td><td width=\"82\"><p>名师课程</p></td><td><p>134学时</p></td><td><p>104学时理论基础、30学时高分技巧。</p></td></tr><tr><td><p>直播辅导</p></td><td><p>2学时/月</p></td><td><p>网校每月组织一次名师直播互动解答。</p></td></tr><tr><td rowspan=\"4\"><p>巩固提高</p></td><td><p>知识点练习</p></td><td><p>500道</p></td><td><p>每讲后5-10道针对性练习题，90%正确率过关。</p></td></tr><tr><td><p>真题详解</p></td><td><p>3套</p></td><td><p>2011-2013年3年真题，学员先进行限时全真模考，然后听名师讲解点评。</p></td></tr><tr><td><p>模块练习</p></td><td><p>6套</p></td><td><p>各模块先进行限时答题，然后听名师讲解点评。</p></td></tr><tr><td><p>申论批改</p></td><td><p>2篇</p></td><td><p>对学员申论答案进行系统批改。</p></td></tr><tr><td rowspan=\"2\"><p>模考冲刺</p></td><td><p>冲刺串讲</p></td><td><p>20学时</p></td><td><p>考前10天冲刺串讲，系统梳理考点，精准预测。</p></td></tr><tr><td><p>冲刺密卷</p></td><td><p>1套</p></td><td><p>学员先进行限时全真模考，然后听名师讲解点评。</p></td></tr><tr><td colspan=\"3\"><p>学员专属互助学习平台</p></td><td><p>专属互助学习平台，行测每天一练，申论每周一练，学员相互学习，名师定期点评。</p></td></tr><tr><td colspan=\"3\"><p>疑难解答</p></td><td><p>通过答疑区提交问题，24小时答疑（工作日内）。</p></td></tr><tr><td colspan=\"3\"><p>模考活动</p></td><td><p>阶段性组织模考，检验学习效果。</p></td></tr><tr><td colspan=\"3\"><p>热点资料</p></td><td><p>每周定期上传时政热点。</p></td></tr><tr><td><br/></td><td><br/></td><td><br/></td><td><br/></td></tr></tbody></table><p><br/></p>', '6110', '3690', null, '2014-02-21 11:46:56', '审核中....', '1', null, '', '4028816c445260d00144528806aa0009', null, '0', '0', '专属互助学习平台，行测每天一练，申论每周一练，学员相互学习，名师定期点评。', '281', null, null, '330000');
INSERT INTO `agency_course` VALUES ('4028816c445260d00144528c9b07000b', '60天高分特训营方案（省市机关）', '9', '1', '4028816c445260d0014452778a730003', '2014-02-21 11:45:50', '0', '', null, '', null, '<p>数据显示，公考成功上岸的考生中一大半是花费1-2个月时间精心备考的。充实、全面的备考是获得良好发挥和优秀成绩的基础条件。《高分特训营方案》就是定位考前一个月至两个月备考的全面学习使用。<br/><br/>通过集中系统培训，对公务员考试的行测和申论考察的知识点和内容有全面、系统的掌握，行测能够提高做题速度，做到一题45秒，申论能过快速阅读，掌握各类材料的概况能力，提高对策能力，熟练掌握大作文构思和写作方法技巧，顺利通过公务员笔试。</p><table align=\"center\" width=\"800\"><tbody><tr><th colspan=\"5\" scope=\"col\">高分特训营方案</th></tr><tr><td rowspan=\"13\" width=\"58\"><p>方案内容</p></td><td colspan=\"2\"><p>方案设置</p></td><td width=\"150\"><p>数量</p></td><td width=\"402\"><p>学习说明</p></td></tr><tr><td colspan=\"2\"><p>习题自测</p></td><td><p>200道</p></td><td><p>每讲课前有1-3道自测题；<br/>须自测，检测自己水平。</p></td></tr><tr><td width=\"74\"><p>理论学习</p></td><td width=\"82\"><p>名师课程</p></td><td><p>134学时</p></td><td><p>104学时理论基础、30学时高分技巧。</p></td></tr><tr><td rowspan=\"4\"><p>巩固提高</p></td><td><p>知识点练习</p></td><td><p>500道</p></td><td><p>每讲后5-10道针对性练习题，90%正确率过关。</p></td></tr><tr><td><p>真题详解</p></td><td><p>3套</p></td><td><p>2011-2013年3年真题，学员先进行限时全真模考，然后听名师讲解点评。</p></td></tr><tr><td><p>模块练习</p></td><td><p>3套</p></td><td><p>各模块先进行限时答题，然后听名师讲解点评。</p></td></tr><tr><td><p>申论批改</p></td><td><p>1篇</p></td><td><p>对学员申论答案进行系统批改。</p></td></tr><tr><td rowspan=\"2\"><p>模考冲刺</p></td><td><p>冲刺串讲</p></td><td><p>20学时</p></td><td><p>考前10天冲刺串讲，系统梳理考点，精准预测。</p></td></tr><tr><td><p>冲刺密卷</p></td><td><p>1套</p></td><td><p>学员先进行限时全真模考，然后听名师讲解点评。</p></td></tr><tr><td colspan=\"3\"><p>学员专属互助学习平台</p></td><td><p>专属互助学习平台，行测每天一练，申论每周一练，学员相互学习，名师定期点评。</p></td></tr><tr><td colspan=\"3\"><p>疑难解答</p></td><td><p>通过答疑区提交问题，24小时答疑（工作日内）。</p></td></tr><tr><td colspan=\"3\"><p>模考活动</p></td><td><p>阶段性组织模考，检验学习效果。</p></td></tr><tr><td colspan=\"3\"><p>热点资料</p></td><td><p>每周定期上传时政热点。</p></td></tr></tbody></table><p><br/></p>', '4140', '2980', null, '2014-02-21 11:47:15', '审核中....', '1', null, '', '4028816c445260d00144528806aa0009', null, '0', '0', '专属互助学习平台，行测每天一练，申论每周一练，学员相互学习，名师定期点评。', '221', null, null, '330000');
