INSERT INTO `agency_recourse` VALUES ('4028816c42bb536b0142bb57ad9d0000', '执业药师资格考试报考指南', '4028816c42b0eca60142b1284007000a', '1', '100', '<p><a href=\"http://www.233.com/yishi/bkzn/zt/yszg/#1515\" style=\"color: rgb(0, 85, 153); text-decoration: none;\">考试介绍</a></p><p>医师资格考试的性质是行业准入考试，是评价申请医师资格者是否具备从事医师工作所必须的专业知识与技能的考试。医师资格考试分实践技能考试和医学综合笔试两部分。</p><p>考试分为两级四类，即执业医师和执业助理医师两级；每级分为临床、中医、口腔、公共卫生四类。中医类包括中医、民族医和中西医结合，其中民族医又含蒙医、藏医和维医三类，其他民族医医师暂不开考。到目前为止，我国医师资格考试共有24种类别。<br/>实践技能考试采用多站测试的方式，考区设有实践技能考试基地，根据考试内容设置若干考站，考生依次通过考站接受实践技能的测试。每位考生必须在同一考试基地的考站进行测试。[<a href=\"http://www.233.com/yishi/bkzn/zt/yszg/#1515\" class=\"cRed\" style=\"color: rgb(255, 102, 0); text-decoration: none;\">查看详情</a>]</p><p style=\"text-align:center\"><img src=\"/userfiles/4028816c42b0eca60142b1284007000a/images/1386125125500.jpg\" style=\"margin: 0px; padding: 0px; border: 0px; vertical-align: top;\"/></p><p><a href=\"http://www.233.com/yishi/bkzn/zt/yszg/#1517\" style=\"color: rgb(0, 85, 153); text-decoration: none;\">报名时间</a></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; border: 0px;\"><strong>1、报名时间&nbsp;</strong><br/>临床执业/助理医师考试报名包括网上报名和现场报名两个部分。网上报名一般在2—3月份，现场报名一般在3—4月份，现场报名主要是对已经网上报名的考生进行资料审核，一般不接受补报名。<br/>2013年临床执业/助理医师考试报名时间：<br/>（1）网上报名时间：2月27日至4月8日。<br/>　　 现场报名时间：3月18日～4月8日。&nbsp;<br/>网上报名方法：<br/>步骤1、考生在国家医学考试中心网站（www.nmec.org.cn）上填报个人报名信息。考生确认、保存报名信息后，系统提示“报名成功”。<br/>步骤2、考生可以在4月中旬前，凭借“个人证件编号”及个人密码，登录国家医学考试中心网站查询、修改个人报名信息。<br/>步骤3、考生确认填报信息无误后，可以打印《医师资格考试报名暨授予医师资格申请表》。<br/><a href=\"http://www.233.com/yishi/baoming/All/20130227/083335811.html\" arget=\"_blank\" style=\"color: rgb(102, 102, 102); text-decoration: none;\"><span style=\"color:#0000FF\">点击进入网上报名入口&gt;&gt;&gt;</span><br/></a>现场报名：<br/>考生持所打印的《医师资格考试报名暨授予医师资格申请表》，按照所在考点的具体要求，进行现场报名及资格审核，提交书面报名材料（如身份证、毕业证书等），交费，拍照（或导入数码照片），并确认个人报名信息。&nbsp;<br/></p><ul style=\"padding: 0px; border: 0px;\" class=\" list-paddingleft-2\"><li><p><span class=\"fh\" style=\"color: rgb(221, 0, 0); font-size: 18px; font-family: 微软雅黑;\">»</span>&nbsp;<a href=\"http://www.233.com/yishi/zhuanti/20130220101/\" target=\"_blank\" style=\"color: rgb(0, 85, 153); text-decoration: none;\">报名专题</a></p></li><li><p><span class=\"fh\" style=\"color: rgb(221, 0, 0); font-size: 18px; font-family: 微软雅黑;\">»</span>&nbsp;<a href=\"http://www.233.com/yszg/dagang/Clinical/\" target=\"_blank\" style=\"color: rgb(0, 85, 153); text-decoration: none;\">考试大纲学习</a></p></li><li><p><span class=\"fh\" style=\"color: rgb(221, 0, 0); font-size: 18px; font-family: 微软雅黑;\">»</span>&nbsp;<a href=\"http://www.233.com/yishi/dagang/20130221/113901553.html\" target=\"_blank\" style=\"color: rgb(0, 85, 153); text-decoration: none;\">报名流程</a></p></li></ul><p><a href=\"http://www.233.com/yishi/bkzn/zt/yszg/#1523\" style=\"color: rgb(0, 85, 153); text-decoration: none;\">考试时间</a></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; border: 0px;\"><strong>一、实践技能考试</strong><br/>实践技能考试时间为2013年7月1日—7月15日，具体由各省、自治区、直辖市省级医师资格考试领导小组组织实施。<br/><strong>二、医学综合笔试</strong><br/>全国统一考试时间为：<br/>执业医师资格考试：2013年9月14日、15日两天，上午9:00—11:30，下午14:00—16:30。<br/>执业助理医师(含乡镇执业助理医师)资格考试：2013年9月14日一天，上午9:00—11:30，下午14:00—16:30。</p><ul style=\"padding: 0px; border: 0px;\" class=\" list-paddingleft-2\"><li><p><span class=\"fh\" style=\"color: rgb(221, 0, 0); font-size: 18px; font-family: 微软雅黑;\">»</span>&nbsp;<a href=\"http://www.233.com/yishi/baoming/All/20130129/113856295.html\" style=\"color: rgb(0, 85, 153); text-decoration: none;\">考试公告</a></p></li></ul><p><a href=\"http://www.233.com/yishi/bkzn/zt/yszg/#1530\" style=\"color: rgb(0, 85, 153); text-decoration: none;\">考试大纲</a></p><p style=\"text-align:center;margin-top: 0px; margin-bottom: 0px; padding: 0px; border: 0px;\"><strong>2013年医师资格考试大纲汇总</strong></p><table cellspacing=\"1\" cellpadding=\"0\" width=\"650\" bgcolor=\"#000000\" align=\"center\"><tbody><tr><td bgcolor=\"#ffffff\" style=\"border-color: rgb(204, 204, 204);\"><p><strong>考试类别</strong></p></td><td bgcolor=\"#ffffff\" style=\"border-color: rgb(204, 204, 204);\"><p><strong>实践技能考试大纲</strong></p></td><td bgcolor=\"#ffffff\" height=\"25\" style=\"border-color: rgb(204, 204, 204);\"><p><strong>医学综合笔试大纲</strong></p></td></tr><tr><td bgcolor=\"#ffffff\" width=\"16%\" style=\"border-color: rgb(204, 204, 204);\"><p>临床执业医师</p></td><td bgcolor=\"#ffffff\" width=\"31%\" style=\"border-color: rgb(204, 204, 204);\"><p><a href=\"http://www.233.com/yishi/skill/dagang/20130301/120927654.html\" target=\"_blank\" style=\"color: rgb(102, 102, 102); text-decoration: none;\"><span style=\"color:#0000FF\">2013年临床执业医师实践技能考试大纲</span></a></p></td><td bgcolor=\"#ffffff\" height=\"25\" style=\"border-color: rgb(204, 204, 204);\"><p><a title=\"2012年临床执业医师考试大纲\" href=\"http://www.233.com/yishi/Clinical/dagang/20130224/135532465.html\" target=\"_blank\" style=\"color: rgb(102, 102, 102); text-decoration: none;\"><span style=\"color:#0000FF\">2013年临床执业医师考试大纲</span></a></p></td></tr><tr><td bgcolor=\"#ffffff\" width=\"16%\" style=\"border-color: rgb(204, 204, 204);\"><p>中医执业医师</p></td><td bgcolor=\"#ffffff\" style=\"border-color: rgb(204, 204, 204);\"><p><a href=\"http://www.233.com/yishi/skill/dagang/20130301/120121558.html\" target=\"_blank\" style=\"color: rgb(102, 102, 102); text-decoration: none;\"><span style=\"color:#0000FF\">2013年中医执业医师实践技能考试大纲</span></a></p></td><td bgcolor=\"#ffffff\" height=\"25\" style=\"border-color: rgb(204, 204, 204);\"><p><a title=\"2012年中医执业医师考试大纲\" href=\"http://www.233.com/yishi/zhongyi/dagang/20130224/145557293.html\" target=\"_blank\" style=\"color: rgb(102, 102, 102); text-decoration: none;\"><span style=\"color:#0000FF\">2013年中医执业医师考试大纲</span></a></p></td></tr><tr><td bgcolor=\"#ffffff\" width=\"16%\" style=\"border-color: rgb(204, 204, 204);\"><p>中西医结合执业医师</p></td><td bgcolor=\"#ffffff\" style=\"border-color: rgb(204, 204, 204);\"><p><a href=\"http://www.233.com/yishi/skill/dagang/20130301/120343549.html\" target=\"_blank\" style=\"color: rgb(102, 102, 102); text-decoration: none;\"><span style=\"color:#0000FF\">2013年中西执业医师实践技能考试大纲</span></a></p></td><td bgcolor=\"#ffffff\" height=\"25\" style=\"border-color: rgb(204, 204, 204);\"><p><a title=\"2012年中西医结合执业医师考试大纲汇总\" href=\"http://www.233.com/yishi/zxyyishi/dagang/20130203/163021654.html\" target=\"_blank\" style=\"color: rgb(102, 102, 102); text-decoration: none;\"><span style=\"color:#0000FF\">2013年中西医执业医师考试大纲</span></a></p></td></tr><tr><td bgcolor=\"#ffffff\" width=\"16%\" style=\"border-color: rgb(204, 204, 204);\"><p>口腔执业医师</p></td><td bgcolor=\"#ffffff\" width=\"31%\" style=\"border-color: rgb(204, 204, 204);\"><p><a href=\"http://www.233.com/yishi/skill/dagang/20130301/120710670.html\" target=\"_blank\" style=\"color: rgb(102, 102, 102); text-decoration: none;\"><span style=\"color:#0000FF\">2013年口腔执业医师实践技能考试大纲</span></a></p></td><td bgcolor=\"#ffffff\" height=\"25\" width=\"27%\" style=\"border-color: rgb(204, 204, 204);\"><p><a title=\"2012年口腔执业医师考试大纲\" href=\"http://www.233.com/yishi/Oral/dagang/20130227/181010635.html\" target=\"_blank\" style=\"color: rgb(102, 102, 102); text-decoration: none;\"><span style=\"color:#0000FF\">2013年口腔执业医师考试大纲</span></a></p></td></tr><tr><td bgcolor=\"#ffffff\" width=\"16%\" style=\"border-color: rgb(204, 204, 204);\"><p>公卫执业医师</p></td><td bgcolor=\"#ffffff\" style=\"border-color: rgb(204, 204, 204);\"><p><a href=\"http://www.233.com/yishi/skill/dagang/20130301/120203283.html\" target=\"_blank\" style=\"color: rgb(102, 102, 102); text-decoration: none;\"><span style=\"color:#0000FF\">2013年公卫执业医师实践技能考试大纲</span></a></p></td><td bgcolor=\"#ffffff\" height=\"25\" style=\"border-color: rgb(204, 204, 204);\"><p><a title=\"2012年公卫执业医师考试大纲\" href=\"http://www.233.com/yishi/Health/dagang/20130228/115946185.html\" target=\"_blank\" style=\"color: rgb(102, 102, 102); text-decoration: none;\"><span style=\"color:#0000FF\">2013年公卫执业医师考试大纲</span></a></p></td></tr><tr><td bgcolor=\"#ffffff\" style=\"border-color: rgb(204, 204, 204);\"><p>临床执业助理医师</p></td><td bgcolor=\"#ffffff