\">2013年中西医助理医师考试大纲</span></a></p></td></tr><tr><td bgcolor=\"#ffffff\" style=\"border-color: rgb(204, 204, 204);\"><p>口腔执业助理医师</p></td><td bgcolor=\"#ffffff\" style=\"border-color: rgb(204, 204, 204);\"><p><a href=\"http://www.233.com/yishi/skill/dagang/20130301/121037144.html\" target=\"_blank\" style=\"color: rgb(102, 102, 102); text-decoration: none;\"><span style=\"color:#0000FF\">2013年口腔助理医师实践技能考试大纲</span></a></p></td><td bgcolor=\"#ffffff\" height=\"25\" style=\"border-color: rgb(204, 204, 204);\"><p><a title=\"2012年口腔助理医师考试大纲\" href=\"http://www.233.com/yishi/oad/dagang/20130228/11311187.html\" target=\"_blank\" style=\"color: rgb(102, 102, 102); text-decoration: none;\"><span style=\"color:#0000FF\">2013年口腔助理医师考试大纲</span></a></p></td></tr><tr><td bgcolor=\"#ffffff\" style=\"border-color: rgb(204, 204, 204);\"><p>公卫执业助理医师</p></td><td bgcolor=\"#ffffff\" style=\"border-color: rgb(204, 204, 204);\"><p><a href=\"http://www.233.com/yishi/skill/dagang/20130301/120245525.html\" target=\"_blank\" style=\"color: rgb(102, 102, 102); text-decoration: none;\"><span style=\"color:#0000FF\">2013年公卫助理医师实践技能考试大纲</span></a></p></td><td bgcolor=\"#ffffff\" height=\"25\" style=\"border-color: rgb(204, 204, 204);\"><p><a title=\"2012年公卫助理医师考试大纲\" href=\"http://www.233.com/yishi/pha/dagang/20130228/132556312.html\" target=\"_blank\" style=\"color: rgb(102, 102, 102); text-decoration: none;\"><span style=\"color:#0000FF\">2013年公卫助理医师考试大纲</span></a></p></td></tr></tbody></table><ul style=\"padding: 0px; border: 0px;\" class=\" list-paddingleft-2\"><li><p><span class=\"fh\" style=\"color: rgb(221, 0, 0); font-size: 18px; font-family: 微软雅黑;\">»</span>&nbsp;<a href=\"http://www.233.com/yishi/bkzn/zt/yszg/#1524\" style=\"color: rgb(0, 85, 153); text-decoration: none;\">考试科目</a></p></li></ul><p><a href=\"http://www.233.com/yishi/bkzn/zt/yszg/#1535\" style=\"color: rgb(0, 85, 153); text-decoration: none;\">考试成绩</a></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; border: 0px;\"><strong>一、成绩评定</strong></p><p><strong>1、考试分数&nbsp;</strong><br/>医师资格考试医学综合笔试由国家医学考试中心统一组织阅卷评分，考试所获得的考生考试分数是卷面答题的原始分数。&nbsp;<br/><strong>2、考试分数的公布</strong>&nbsp;<br/>医师资格考试医学综合笔试结束后，在卫生部医师资格考试委员会规定的时限内，考生考试正式分数将以成绩单的形式寄到各考区，考试成绩以国家医学考试中心下发的考试成绩单为准。考生可在当地卫生行政部门(考试报名所在地)领取考试成绩单。考生也可在国家医学考试网上(http://www.nmec.org.cn)查询考试原始分数。<br/>考试成绩以国家医学考试中心下发的考试成绩单为准。&nbsp;<br/><strong>3、成绩单&nbsp;</strong><br/>考试成绩单是国家医学考试中心向考生报告考试分数的唯一正式文件，也是考生申请注册的重要依据，须妥善保存。如成绩单印刷错误或姓名、考试类别等打印有误时，可向考点办公室提出重新打印的书面申请，经考点、考区核查确属打印（印刷）有误时，按规定程序重新发放成绩单。考试成绩单手写、复印均属无效。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; border: 0px;\"><strong>二、</strong><strong>成绩查询</strong></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; border: 0px;\">医师资格考试分实践技能考试和医学综合笔试两部分。其中医师实践技能考试成绩约考后半个月陆续发布，而医师资格考试综合笔试考试成绩一般在考后2个月左右可查询。<br/><strong>相关信息：</strong><a href=\"http://www.233.com/skill/zhuanti/2012070280/\" target=\"_blank\" style=\"color: rgb(102, 102, 102); text-decoration: none;\"><span style=\"color:#0000FF\">2012年医师实践技能考试成绩查询专题</span></a></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; border: 0px;\"><strong>三、</strong><strong>合格标准</strong></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; border: 0px;\">医师实践技能考试满分100分，60分及格；医学综合笔试合格分数线每年都会有所变化。<br/><strong>相关信息：</strong><a href=\"http://www.233.com/yishi/chengji/All/20101222/104420894.html\" target=\"_blank\" style=\"color: rgb(102, 102, 102); text-decoration: none;\"><span style=\"color:#0000FF\">1999~2011年医师资格考试医学综合笔试合格分数线</span></a></p><p><br/></p>', '2013-12-04 10:02:34');
INSERT INTO `agency_recourse` VALUES ('4028816c42bb536b0142bb58e9f50001', '医师资格考试报考指南', '4028816c42b0eca60142b1284007000a', '1', '99', '<p><span style=\"color: rgb(0, 85, 153); font-family: 微软雅黑; font-size: 16px; font-weight: bold; line-height: 30px; background-color: rgb(255, 255, 255);\">考试介绍</span></p><p>医师资格考试的性质是行业准入考试，是评价申请医师资格者是否具备从事医师工作所必须的专业知识与技能的考试。医师资格考试分实践技能考试和医学综合笔试两部分。</p><p>考试分为两级四类，即执业医师和执业助理医师两级；每级分为临床、中医、口腔、公共卫生四类。中医类包括中医、民族医和中西医结合，其中民族医又含蒙医、藏医和维医三类，其他民族医医师暂不开考。到目前为止，我国医师资格考试共有24种类别。<br/>实践技能考试采用多站测试的方式，考区设有实践技能考试基地，根据考试内容设置若干考站，考生依次通过考站接受实践技能的测试。每位考生必须在同一考试基地的考站进行测试。<br/>医师资格考试医学综合笔试于9月中旬举行，具体时间以卫生部医师资格考试委员会公告时间为准。临床执业医师考试时间为2天，分4个单元；临床执业助理医师考试时间为1天，分2个单元，每单元均为两个半小时。 医学综合笔试全部采用选择题形式。采用A型和B型题，共有A1、A2、A3、A4、B1五种题型。临床助理医师适当减少或不采用A3型题。临床执业考试总题量约为600题，临床执业助理医师考试总题量为300题。</p><p><span style=\"color: rgb(0, 85, 153); font-family: 微软雅黑; font-size: 16px; font-weight: bold; line-height: 30px; background-color: rgb(255, 255, 255);\">报考条件</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; border: 0px;\"><strong>临床执业医师</strong></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; border: 0px;\">依据《中华人民共和国执业医师法》相关规定，内容如下：&nbsp;<br/>第九条 具有下列条件之一的，可以参加执业医师资格考试：&nbsp;<br/>（一）具有高等学校医学专业本科以上学历，在执业医师指导下，在医疗、预防、保健机构中试用期满一年的；&nbsp;<br/>（二）取得执业助理医师执业证书后，具有高等学校医学专科学历，在医疗、预防、保健机构中工作满二年；具有中等专业学校医学专业学历，在医疗、预防、保健机构中工作满五年的。&nbsp;<br/><strong>医师资格考试报名资格规定：&nbsp;</strong><br/>十五、具有下列情形之一的，不予受理医师资格考试报名：&nbsp;<br/>1、卫生职业高中毕业生；&nbsp;<br/>2、基础医学类、法医学类、护理学类、辅助医疗类、医学技术类等相关医学类和药学类、医学管理类毕业生；&nbsp;<br/>3、医学专业毕业，但教学大纲和专业培养方向或毕业证书注明为非医学方向的；&nbsp;<br/>4、医学专业毕业，但教学大纲和专业培养方向或学位证书证明学位是非医学的；&nbsp;<br/>5、非现役军人持军队医疗、预防、保健机构出具的试用期证明报考或在军队报名参加医师资格考试的；&nbsp;<br/>6、现役军人持地方医疗、预防、保健机构出具的试用期证明报告的；&nbsp;<br/>7、持《专业证书》或《学业证书》报名参加医师资格考试的；&nbsp;<br/>8、1999年1月1日以后入学的卫生职工中等专业学校的学生毕业后报考执业助理医师资格考试的。&nbsp;<br/><span style=\"color: rgb(0, 85, 153); font-family: 微软雅黑; font-size: 16px; font-weight: bold; line-height: 30px; background-color: rgb(255, 255, 255);\">特别说明：&nbsp;</span><br/>1.成教学历是否可以报考临床执业医师？&nbsp;<br/>医学成人学历教育不作为执业医师资格考试的依据。但2002年10月31日前，成人高等教育、自学考试、各类高等学校远程教育的医学类专业学历教育除外。&nbsp;<br/>2002年10月31日前，职业技术学院、非医药卫生类专科学校医学类专业学生，毕业后取得的医学学历可作为医师资格考试报名的学历依据。&nbsp;<br/>2.报考试用期截止日期及试用期证明有效期。&nbsp;<br/>医师资格考试报考人员试用期截止至考试当年8月31日。考生报名后未按期完成试用的，取消报名资格。&nbsp;<br/>试用机构出具的试用期满1年并考核合格的证明当年有效。再次参加医师资格考试，需重新在试用机构试用并提供考核合格证明。&nbsp;</p><p><br/></p>', '2013-12-04 10:03:55');
INSERT INTO `agency_recourse` VALUES ('4028816c42bb5cfe0142bb6a5b890000', '银行从业资格考试简介', '4028816c42b0eca60142b1284007000a', '1', '77', '<p></p><p>考试简介</p><p>银行从业资格考试简介：&nbsp;<br/>CCBP是“中国银行业从业人员资格认证”（ Certification of China Banking Professional）的英文缩写。建立银行业从业人员资格认证制度是依法从事银行业专业岗位的学识、技术和能力的基本要求。 中国银行业从业人员资格认证制度，由四个基本的环节组成，即资格标准、考试制度、资格审核和继续教育。&nbsp;<br/>热点新闻：<a href=\"http://www.233.com/ccbp/zhinan/20090926/095908512.html\" target=\"_blank\" style=\"color: rgb(221, 0, 0);\">中国银行业从业人员资格认证考试简介</a></p><p>报名条件</p><p>银行从业人员资格考试面向社会开放。符合以下条件的人员，可以报名参加资格考试：<br/>（一）年满18岁；<br/>（二）具有完全民事行为能力；&nbsp;<br/>（三）具有高中以上文化程度。<br/>有下列情形之一的人员，不得报名参加考试，已经办理报名手续的，报名无效：&nbsp;<br/>（一）因故意犯罪受过刑事处罚的；&nbsp;<br/>（二）曾被银行及金融业机构开除公职的；&nbsp;<br/>（三）依照《中国银行业从业人员资格认证考试实施办法（试行）》规定，应试人员有以下情形之一的，经考试办公室确认后，视情节、后果分别给予警告、考试成绩无效、2年内或终身不得报名参加资格考试等处分：1、考试报名时本人隐匿或伪造资格认证所需真实信息的；2、违反考场纪律，扰乱考场秩序，有作弊等违纪行为的。<br/>热点新闻：<br/><a href=\"http://www.233.com/ccbp/zhinan/20121029/095216195.html\" target=\"_blank\" style=\"color: rgb(221, 0, 0);\">2013年银行从业资格考试报名条件</a></p><p><br/></p>', '2013-12-04 10:22:58');
INSERT INTO `agency_recourse` VALUES ('4028816c42bb6c160142bb6da3ce0000', '2013年注册会计师考试报名条件', '4028816c42b0eca60142b1284007000a', '1', '88', '<table cellspacing=\"1\" cellpadding=\"0\" bgcolor=\"#b5cbd6\" align=\"center\"><tbody><tr><td bgcolor=\"#e6f3ff\" height=\"25\" width=\"114\"><a href=\"http://www.233.com/cpa/jieshao/20130410/102848340.html\" target=\"_blank\" style=\"color: rgb(51, 51, 51); text-decoration: none;\"><span style=\"color:#0000ff\">考办联系方式</span></a></td><td bgcolor=\"#e6f3ff\" width=\"101\"><a href=\"http://www.233.com/cpa/jieshao/20130410/111603811.html\" target=\"_blank\" style=\"color: rgb(51, 51, 51); text-decoration: none;\"><span style=\"color:#0000ff\">考办考区信息</span></a></td><td bgcolor=\"#e6f3ff\" width=\"78\"><a href=\"http://www.233.com/cpa/jieshao/20130410/093947588.html\" target=\"_blank\" style=\"color: rgb(51, 51, 51); text-decoration: none;\"><span style=\"color:#0000ff\">报名流程</span></a></td><td bgcolor=\"#e6f3ff\" width=\"103\"><a href=\"http://www.233.com/cpa/jieshao/20130410/092450434.html\" target=\"_blank\" style=\"color: rgb(51, 51, 51); text-decoration: none;\"><span style=\"color:#0000ff\">报名问答</span></a></td><td bgcolor=\"#e6f3ff\" width=\"163\"><a href=\"http://www.233.com/cpa/jieshao/20130410/092345942.html\" target=\"_blank\" style=\"color: rgb(51, 51, 51); text-decoration: none;\"><span style=\"color:#0000ff\">网上报名系统开放时间</span></a></td><td bgcolor=\"#e6f3ff\" width=\"44\"><a href=\"http://www.233.com/cpa/jieshao/20130408/101428119.html\" target=\"_blank\" style=\"color: rgb(51, 51, 51); text-decoration: none;\"><span style=\"color:#0000ff\">教材</span></a></td></tr><tr><td bgcolor=\"#e6f3ff\" height=\"25\"><a href=\"http://www.233.com/cpa/zhuanti/20130329412/\" target=\"_blank\" style=\"color: rgb(51, 51, 51); text-decoration: none;\"><span style=\"color:#0000ff\">报名时间</span></a></td><td bgcolor=\"#e6f3ff\" width=\"103\"><a href=\"http://www.233.com/cpa/baoming/All/20130410/091904295.html\" target=\"_blank\" style=\"color: rgb(51, 51, 51); text-decoration: none;\"><span style=\"color:#ff0000\">报名入口</span></a></td><td bgcolor=\"#e6f3ff\" width=\"79\"><a href=\"http://www.233.com/cpa/zhuanti/20130403424/\" target=\"_blank\" style=\"color: rgb(51, 51, 51); text-decoration: none;\"><span style=\"color:#0000ff\">考试大纲</span></a></td><td bgcolor=\"#e6f3ff\" width=\"17\"><a href=\"http://www.233.com/cpa/zhuanti/20130401420/\" target=\"_blank\" style=\"color: rgb(51, 51, 51); text-decoration: none;\"><span style=\"color:#0000ff\">新旧大纲对比</span></a></td><td bgcolor=\"#e6f3ff\" width=\"13\"><a href=\"http://www.233.com/cpa/baoming/All/20130329/085006262.html\" target=\"_blank\" style=\"color: rgb(51, 51, 51); text-decoration: none;\"><span style=\"color:#0000ff\">考试时间</span></a>/<a href=\"http://www.233.com/cpa/zhuanti/20130322400/\" target=\"_blank\" style=\"color: rgb(51, 51, 51); text-decoration: none;\"><span style=\"color:#0000ff\">报考建议</span></a></td><td bgcolor=\"#e6f3ff\" width=\"46\"><a href=\"http://www.233.com/cpa/zhuanti/20130401419/\" target=\"_blank\" style=\"color: rgb(51, 51, 51); text-decoration: none;\"><span style=\"color:#0000ff\">机考</span></a></td></tr></tbody></table><p><span style=\"font-family: 宋体; font-size: 14px; line-height: 25px;  background-color: rgb(245, 253, 255);\">　　</span><strong style=\"font-family: 宋体; font-size: 14px; line-height: 25px; white-space: normal; background-color: rgb(245, 253, 255);\">2013年注册会计师<span style=\"color:#f70909\">专业阶段</span>考试报名条件</strong><span style=\"font-family: 宋体; font-size: 14px; line-height: 25px;  background-color: rgb(245, 253, 255);\"></span></p><p style=\"margin: 10px auto; padding: 0px; border: 0px; font-family: 宋体; font-size: 14px; line-height: 25px; white-space: normal; background-color: rgb(245, 253, 255);\">　　1、具有完全民事行为能力；</p><p style=\"margin: 10px auto; padding: 0px; border: 0px; font-family: 宋体; font-size: 14px; line-height: 25px; white-space: normal; background-color: rgb(245, 253, 255);\">　　2、具有高等专科以上学校毕业学历、或者具有会计或相关专业中级以上技术职称。</p><p style=\"margin: 10px auto; padding: 0px; border: 0px; font-family: 宋体; font-size: 14px; line-height: 25px; white-space: normal; background-color: rgb(245, 253, 255);\"><strong>　　免试条件</strong></p><p style=\"margin: 10px auto; padding: 0px; border: 0px; font-family: 宋体; font-size: 14px; line-height: 25px; white-space: normal; background-color: rgb(245, 253, 255);\">　　具有会计或者相关专业高级技术职称的人员（包括学校及科研单位中具有会计或者相关专业副教授、副研究员以上职称者），可以申请免予专业阶段考试1个专长科目的考试。</p><p style=\"margin: 10px auto; padding: 0px; border: 0px; font-family: 宋体; font-size: 14px; line-height: 25px; white-space: normal; background-color: rgb(245, 253, 255);\">　　申请免予考试的人员，应当填写《注册会计师全国统一考试——专业阶段考试科目免试申请表（2010年度）》（见附件），并向报名所在地省级财政厅（局）注册会计师考试委员会办公室（以下简称地方考办）提交高级技术职称证书及复印件。地方考办审核无误后，报财政部注册会计师考试委员会办公室（以下简称财政部考办）审核批准，方可免试。</p><p style=\"margin: 10px auto; padding: 0px; border: 0px; font-family: 宋体; font-size: 14px; line-height: 25px; white-space: normal; background-color: rgb(245, 253, 255);\">　　<strong>2013年注册会计师<span style=\"color:#ff0000\">综合阶段</span>考试报名条件&nbsp;</strong></p><p style=\"margin: 10px auto; padding: 0px; border: 0px; font-family: 宋体; font-size: 14px; line-height: 25px; white-space: normal; background-color: rgb(245, 253, 255);\">　　1、具有完全民事行为能力；</p><p style=\"margin: 10px auto; padding: 0px; border: 0px; font-family: 宋体; font-size: 14px; line-height: 25px; white-space: normal; background-color: rgb(245, 253, 255);\">　　2、已取得财政部考委会颁发的注册会计师全国统一考试专业阶段考试合格证书的。</p><p style=\"margin: 10px auto; padding: 0px; border: 0px; font-family: 宋体; font-size: 14px; line-height: 25px; white-space: normal; background-color: rgb(245, 253, 255);\">　　<strong>课程辅导：</strong><a href=\"http://wx.233.com/cpa/\" target=\"_blank\" style=\"color: rgb(51, 51, 51); text-decoration: none;\"><span style=\"color:#ff0000\">2013年注会HD高清课件全新上线</span></a>　<a href=\"http://wx.233.com/cpa/\" target=\"_blank\" style=\"color: rgb(51, 51, 51); text-decoration: none;\"><span style=\"color:#ff0000\">业内顶级名师聚首助你轻松拿证</span></a></p><p style=\"margin: 10px auto; padding: 0px; border: 0px; font-family: 宋体; font-size: 14px; line-height: 25px; white-space: normal; background-color: rgb(245, 253, 255);\">　　<strong>报考指南：</strong><a href=\"http://www.233.com/cpa/baoming/All/20130319/090730707.html\" target=\"_blank\" style=\"color: rgb(51, 51, 51); text-decoration: none;\"><span style=\"color:#0000ff\">2013注会报名政策解读</span></a>&nbsp;<a href=\"http://www.233.com/cpa/jieshao/20121206/170646550.html\" target=\"_blank\" style=\"color: rgb(51, 51, 51); text-decoration: none;\"><span style=\"color:#0000ff\">注会各科考试时间</span></a>&nbsp;<a href=\"http://www.233.com/cpa/jieshao/20121206/171239931.html\" target=\"_blank\" style=\"color: rgb(51, 51, 51); text-decoration: none;\"><span style=\"color:#0000ff\">注会报名时间</span></a>&nbsp;<a href=\"http://www.233.com/cpa/zhuanti/20130321396/\" target=\"_blank\" style=\"color: rgb(51, 51, 51); text-decoration: none;\"><span style=\"color:#0000ff\">报名条件及免试条件</span></a></p><p style=\"margin: 10px auto; padding: 0px; border: 0px; font-family: 宋体; font-size: 14px; line-height: 25px; white-space: normal; background-color: rgb(245, 253, 255);\">　　<strong>要点推荐：</strong><a href=\"http://www.examda.com/cpa/jieshao/20100424/165351344.html\" target=\"_blank\" style=\"color: rgb(51, 51, 51); text-decoration: none;\"><span style=\"color:#0000ff\">注册会计师考试须知</span></a>　<a href=\"http://www.examda.com/cpa/jieshao/20100406/104649865.html\" target=\"_blank\" style=\"color: rgb(51, 51, 51); text-decoration: none;\"><span style=\"color:#0000ff\">全国各地方注册会计师考办联系方式及咨询电话</span></a></p><p style=\"margin: 10px auto; padding: 0px; border: 0px; font-family: 宋体; font-size: 14px; line-height: 25px; white-space: normal; background-color: rgb(245, 253, 255);\">　　<strong>历年真题</strong>：<a href=\"http://www.233.com/cpa/cpa/zhenti/20080310/154800983.html\" style=\"color: rgb(51, 51, 51); text-decoration: none;\"><span style=\"color:#0000ff\">1997-2011年注册会计师考试(CPA)真题及答案汇总</span></a></p><p><br/></p>', '2013-12-04 10:26:34');
