INSERT INTO `agency_recourse` VALUES ('4028816c42c700c10142c73cdd9b000d', '2014年全国翻译专业资格(水平)考试时间', '4028816c42c0dc420142c18ab49b0000', '1', '2', '<p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 16px 0px 26px; border: 0px; line-height: 26px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><strong>各位考生：</strong></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 16px 0px 26px; border: 0px; line-height: 26px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">　根据《2014年度专业技术人员资格考试工作计划》获悉，2014年全国翻译专业(资格)水平考试考试时间安排：<strong>2014年上半年5月24日、25日，下半年11月9日、10日，</strong>举行(一、二、三级翻译专业资格(水平)考试为全国统一考试)，请广大考生做好备考准备，233网校预祝大家取得好成绩!</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 16px 0px 26px; border: 0px; line-height: 26px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">　</p><table bordercolor=\"#000000\" cellspacing=\"1\" cellpadding=\"0\" width=\"560\" align=\"center\" bgcolor=\"#000000\"><tbody><tr><td align=\"middle\" bgcolor=\"#ffffff\" colspan=\"2\" height=\"25\" style=\"padding: 0px; border: 0px; background-color: white;\">考 试 科 目</td><td align=\"middle\" bgcolor=\"#ffffff\" colspan=\"3\" height=\"25\" style=\"padding: 0px; border: 0px; background-color: white;\">考 试 时 间</td></tr><tr><td align=\"middle\" width=\"105\" bgcolor=\"#ffffff\" height=\"25\" style=\"padding: 0px; border: 0px; background-color: white;\">二、三级<a href=\"http://www.eng24.com/learning/fyks/\" target=\"_blank\" style=\"color: blue; text-decoration: none; display: inline-block;\">口译</a></td><td align=\"middle\" width=\"106\" bgcolor=\"#ffffff\" height=\"25\" style=\"padding: 0px; border: 0px; background-color: white;\">口译综合能力</td><td align=\"middle\" width=\"74\" bgcolor=\"#ffffff\" height=\"25\" rowspan=\"3\" style=\"padding: 0px; border: 0px; backgr