\"padding: 0px; border: 0px; background-color: white;\">9:30-11:30</td></tr><tr><td align=\"middle\" bgcolor=\"#ffffff\" height=\"25\" style=\"padding: 0px; border: 0px; background-color: white;\">二、三级笔译</td><td align=\"middle\" bgcolor=\"#ffffff\" height=\"25\" style=\"padding: 0px; border: 0px; background-color: white;\">笔译实务</td><td align=\"middle\" bgcolor=\"#ffffff\" height=\"25\" style=\"padding: 0px; border: 0px; background-color: white;\">下午</td><td bgcolor=\"#ffffff\" height=\"25\" style=\"padding: 0px; border: 0px; background-color: white;\">14:00-17:00</td></tr><tr><td align=\"middle\" bgcolor=\"#ffffff\" height=\"25\" style=\"padding: 0px; border: 0px; background-color: white;\">二、三级口译</td><td align=\"middle\" bgcolor=\"#ffffff\" height=\"25\" style=\"padding: 0px; border: 0px; background-color: white;\">口译综合能力</td><td align=\"middle\" bgcolor=\"#ffffff\" height=\"25\" rowspan=\"3\" style=\"padding: 0px; border: 0px; background-color: white;\">11月8日</td><td align=\"middle\" bgcolor=\"#ffffff\" height=\"25\" style=\"padding: 0px; border: 0px; background-color: white;\">上午</td><td bgcolor=\"#ffffff\" height=\"25\" style=\"padding: 0px; border: 0px; background-color: white;\">10:00—11:00</td></tr><tr><td bordercolor=\"#000000\" align=\"middle\" bgcolor=\"#ffffff\" height=\"25\" style=\"padding: 0px; border: 0px; background-color: white;\">二级口译</td><td bordercolor=\"#000000\" align=\"middle\" bgcolor=\"#ffffff\" height=\"25\" style=\"padding: 0px; border: 0px; background-color: white;\">口译实务&nbsp;<br/>（交替传译）</td><td bordercolor=\"#000000\" align=\"middle\" bgcolor=\"#ffffff\" height=\"25\" rowspan=\"2\" style=\"padding: 0px; border: 0px; background-color: white;\">下午</td><td bordercolor=\"#000000\" bgcolor=\"#ffffff\" height=\"25\" style=\"padding: 0px; border: 0px; background-color: white;\">13:10入场完毕&nbsp;<br/>13:10-13:30试带&nbsp;<br/>13:30-14:30考试</td></tr><tr><td bordercolor=\"#000000\" align=\"middle\" bgcolor=\"#ffffff\" height=\"25\" style=\"padding: 0px; border: 0px; background-color: white;\">三级口译</td><td bordercolor=\"#000000\" align=\"middle\" bgcolor=\"#ffffff\" height=\"25\" style=\"padding: 0px; border: 0px; background-color: white;\">口译实务</td><td bordercolor=\"#000000\" bgcolor=\"#ffffff\" height=\"25\" style=\"padding: 0px; border: 0px; background-color: white;\">13:10入场完毕&nbsp;<br/>13:10-13:30试带&nbsp;<br/>13:30-14:00考试</td></tr><tr><td align=\"middle\" bgcolor=\"#ffffff\" height=\"25\" style=\"padding: 0px; border: 0px; background-color: white;\">二、三级笔译</td><td align=\"middle\" bgcolor=\"#ffffff\" height=\"25\" style=\"padding: 0px; border: 0px; background-color: white;\">笔译综合能力</td><td align=\"middle\" bgcolor=\"#ffffff\" height=\"25\" rowspan=\"2\" style=\"padding: 0px; border: 0px; background-color: white;\">11月9日</td><td align=\"middle\" bgcolor=\"#ffffff\" height=\"25\" style=\"padding: 0px; border: 0px; background-color: white;\">上午</td><td bgcolor=\"#ffffff\" height=\"25\" style=\"padding: 0px; border: 0px; background-color: white;\">9:30-11:30</td></tr><tr><td align=\"middle\" bgcolor=\"#ffffff\" height=\"25\" style=\"padding: 0px; border: 0px; background-color: white;\">二、三级笔译</td><td align=\"middle\" bgcolor=\"#ffffff\" height=\"25\" style=\"padding: 0px; border: 0px; background-color: white;\">笔译实务</td><td align=\"middle\" bgcolor=\"#ffffff\" height=\"25\" style=\"padding: 0px; border: 0px; background-color: white;\">下午</td><td bgcolor=\"#ffffff\" height=\"25\" style=\"padding: 0px; border: 0px; background-color: white;\">14:00-17:00</td></tr></tbody></table><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 16px 0px 26px; border: 0px; line-height: 26px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">&nbsp;</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 16px 0px 26px; border: 0px; line-height: 26px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">　　考试分7个语种，分别是英、日、法、阿拉伯、俄、德、西班牙等语种;四个等级，即：资深翻译;一级口译、笔译翻译;二级口译、笔译翻译;三级口译、笔译翻译;两大类别，即：<a href=\"http://www.eng24.com/learning/fyks/\" target=\"_blank\" style=\"color: blue; display: inline-block;\">笔译</a>、口译，<a href=\"http://www.eng24.com/learning/fyks/\" target=\"_blank\" style=\"color: blue; display: inline-block;\">口译</a>又分交替传译和同声传译两个专业类别。</p><p><br/></p>', '2013-12-06 17:28:44');
INSERT INTO `agency_recourse` VALUES ('4028816c42c700c10142c73d5684000e', '翻译技巧:汉译英最易翻错的句子(1)', '4028816c42c0dc420142c18ab49b0000', '1', '3', '<p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; border: 0px; line-height: 24px; color: rgb(51, 51, 51); font-family: 宋体, &#39;Lucida Grande&#39;, Verdana, Lucida, Arial, Helvetica, sans-serif; font-size: 15px; white-space: normal;\">01. 有他这颗扫帚星，什么事情都办不成。</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; border: 0px; line-height: 24px; color: rgb(51, 51, 51); font-family: 宋体, &#39;Lucida Grande&#39;, Verdana, Lucida, Arial, Helvetica, sans-serif; font-size: 15px; white-space: normal;\">　　[误] With a comet like him, nothing can be accomplished.</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; border: 0px; line-height: 24px; color: rgb(51, 51, 51); font-family: 宋体, &#39;Lucida Grande&#39;, Verdana, Lucida, Arial, Helvetica, sans-serif; font-size: 15px; white-space: normal;\">　　[正] With a jinx like him, nothing can be accomplished.</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; border: 0px; line-height: 24px; color: rgb(51, 51, 51); font-family: 宋体, &#39;Lucida Grande&#39;, Verdana, Lucida, Arial, Helvetica, sans-serif; font-size: 15px; white-space: normal;\">　　注：“扫帚星”是中国人对“慧星”（comet）的俗称，因其后面象拖着的一条像扫帚一样的长尾巴而得名。在中国古代，“扫帚星”被认为是灾难的预兆，并被用来比喻不吉利的人或事；祸根：（person or thing that is thought to bring）bad luck（to sb/sth）；curse。英语的 comet 虽然没有这层含义，但却有一个对应的说法，即 jinx。 例：There’s a jinx on/Someone’s put a jinx on this car: it’s always giving me trouble. “这辆汽车上有什么妨人的东西，总给我找麻烦”。</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; border: 0px; line-height: 24px; color: rgb(51, 51, 51); font-family: 宋体, &#39;Lucida Grande&#39;, Verdana, Lucida, Arial, Helvetica, sans-serif; font-size: 15px; white-space: normal;\">　　02.萝卜青菜，各有所爱。</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; border: 0px; line-height: 24px; color: rgb(51, 51, 51); font-family: 宋体, &#39;Lucida Grande&#39;, Verdana, Lucida, Arial, Helvetica, sans-serif; font-size: 15px; white-space: normal;\">　　[误] Some prefer radish but others prefer cabbage.</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; border: 0px; line-height: 24px; color: rgb(51, 51, 51); font-family: 宋体, &#39;Lucida Grande&#39;, Verdana, Lucida, Arial, Helvetica, sans-serif; font-size: 15px; white-space: normal;\">　　[正] Tastes differ.</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; border: 0px; line-height: 24px; color: rgb(51, 51, 51); font-family: 宋体, &#39;Lucida Grande&#39;, Verdana, Lucida, Arial, Helvetica, sans-serif; font-size: 15px; white-space: normal;\">　　注：Tastes differ/vary 是句英语谚语，除此以外，原句还可翻译成 No dish suits all tastes 或 You can never make everyone happy 等。《新概念英语》第三册第23课的标题是：One man’s meat is another man’s poison，表达的很生动。 总之，应采取意译。<br/>&nbsp;<br/>　　03.他一向嘴硬，从不认错。</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; border: 0px; line-height: 24px; color: rgb(51, 51, 51); font-family: 宋体, &#39;Lucida Grande&#39;, Verdana, Lucida, Arial, Helvetica, sans-serif; font-size: 15px; white-space: normal;\">　　[误] He has always got a hard mouth and never admit a fault.</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; border: 0px; line-height: 24px; color: rgb(51, 51, 51); font-family: 宋体, &#39;Lucida Grande&#39;, Verdana, Lucida, Arial, Helvetica, sans-serif; font-size: 15px; white-space: normal;\">　　[正] He never says uncle.</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; border: 0px; line-height: 24px; color: rgb(51, 51, 51); font-family: 宋体, &#39;Lucida Grande&#39;, Verdana, Lucida, Arial, Helvetica, sans-serif; font-size: 15px; white-space: normal;\">　　注：say (cry) uncle: to give up or in; to surrender; to admit defeat. Mainly used by boys, as when fighting。主要是男孩们打架时的用语，当一方想制服另一方时，就用命令的口气说：“Say uncle!”这时，有的孩子为了表示不服输，就是不说。后来，say uncle 就成了“服输”的代名词，而 not say uncle 就相当于“嘴硬”了。</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; border: 0px; line-height: 24px; color: rgb(51, 51, 51); font-family: 宋体, &#39;Lucida Grande&#39;, Verdana, Lucida, Arial, Helvetica, sans-serif; font-size: 15px; white-space: normal;\">　　04.老师很喜欢这个嘴甜的小姑娘。</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; border: 0px; line-height: 24px; color: rgb(51, 51, 51); font-family: 宋体, &#39;Lucida Grande&#39;, Verdana, Lucida, Arial, Helvetica, sans-serif; font-size: 15px; white-space: normal;\">　　[误] The teacher likes this sweet-mouthed little girl very much.</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; border: 0px; line-height: 24px; color: rgb(51, 51, 51); font-family: 宋体, &#39;Lucida Grande&#39;, Verdana, Lucida, Arial, Helvetica, sans-serif; font-size: 15px; white-space: normal;\">　　[正] The teacher likes this honey-lipped little girl very much.</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; border: 0px; line-height: 24px; color: rgb(51, 51, 51); font-family: 宋体, &#39;Lucida Grande&#39;, Verdana, Lucida, Arial, Helvetica, sans-serif; font-size: 15px; white-space: normal;\">　　注：中国人喜欢说“嘴甜”，但 honey-lipped 更符合英美人的语言习惯。</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; border: 0px; line-height: 24px; color: rgb(51, 51, 51); font-family: 宋体, &#39;Lucida Grande&#39;, Verdana, Lucida, Arial, Helvetica, sans-serif; font-size: 15px; white-space: normal;\">　　05.同学们都很讨厌他，因为他经常拍老师的马屁。</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; border: 0px; line-height: 24px; color: rgb(51, 51, 51); font-family: 宋体, &#39;Lucida Grande&#39;, Verdana, Lucida, Arial, Helvetica, sans-serif; font-size: 15px; white-space: normal;\">　　[误] The student all dislike him because he often pats the teacher’s ass.</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; border: 0px; line-height: 24px; color: rgb(51, 51, 51); font-family: 宋体, &#39;Lucida Grande&#39;, Verdana, Lucida, Arial, Helvetica, sans-serif; font-size: 15px; white-space: normal;\">　　[正] The students all dislike him because he often licks the teacher’s boots.</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; border: 0px; line-height: 24px; color: rgb(51, 51, 51); font-family: 宋体, &#39;Lucida Grande&#39;, Verdana, Lucida, Arial, Helvetica, sans-serif; font-size: 15px; white-space: normal;\">　　注：以前在欧洲，臣民见到国王与王后往往要葡匐到在，亲吻他们的靴子。后来，人们将 lick the boots 引申为“为了某种目的而讨好某人”，它与汉语的“拍马屁”含义一样。在美国英语中，“拍马屁”还有另一种说法，即 polish the apple，它典出以前的学生用擦亮的苹果来讨好老师。</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; border: 0px; line-height: 24px; color: rgb(51, 51, 51); font-family: 宋体, &#39;Lucida Grande&#39;, Verdana, Lucida, Arial, Helvetica, sans-serif; font-size: 15px; white-space: normal;\"><span style=\"color:#f70909\"><strong>更多翻译资格考试相关信息请关注:</strong></span></p><p><span style=\"color:#f70909;font-family: 宋体, &#39;Lucida Grande&#39;, Verdana, Lucida, Arial, Helvetica, sans-serif; font-size: 15px; line-height: 24px; white-space: normal;\"><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; border: 0px;\"><a href=\"http://www.eng24.com/leraning/class_fyzg/jieshao.htm\" target=\"_blank\" style=\"color: rgb(0, 0, 0); text-decoration: none;\"><span style=\"color:red\"><strong>2008全国翻译资格等级考试网上辅导方案</strong></span></a><strong>&nbsp;<img height=\"11\" src=\"null\" width=\"28\" style=\"margin: 0px; padding: 0px; border: 0px;\"/>&nbsp;<br/><span class=\"style3\"><span style=\"color:#f70909\">2008年全国翻译资格等级考试下半年考试时间:11月8日,9日</span></span>&nbsp;<br/></strong><a href=\"http://www.eng24.com/web_news/html/2008-8/2008825103246664.html\" target=\"_blank\" style=\"color: rgb(0, 0, 0); text-decoration: none;\"><span style=\"color:#0000ff\">全国翻译资格等级考试常见问题及解答</span></a>&nbsp;<br/><span class=\"style3\"><a href=\"http://www.eng24.com/web_news/html/2008-8/200882517321331.html\" target=\"_blank\" style=\"color: rgb(0, 0, 0); text-decoration: none;\"><span style=\"color:#0000ff\">全国翻译资格等级考试大纲汇总</span></a><span style=\"color:#f70909\">&nbsp;<img height=\"10\" src=\"null\" width=\"26\" style=\"margin: 0px; padding: 0px; border: 0px;\"/></span><span style=\"color:#000000\">&nbsp;</span><br/></span><a href=\"http://www.eng24.com/web_book/index_up.asp?id=1773\" target=\"_blank\" style=\"color: rgb(0, 0, 0); text-decoration: none;\"><span style=\"color:#0000ff\">翻译资格等级考试用书推荐</span></a><span class=\"style3\"><span style=\"color:#000000\">&nbsp;</span></span></p></span></p><p><br/></p>', '2013-12-06 17:29:15');
INSERT INTO `agency_recourse` VALUES ('4028816c42c700c10142c73e2a5f000f', '如何让你的英文简历更有竞争力', '4028816c42c0dc420142c18ab49b0000', '1', '4', '<p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 16px 0px 26px; border: 0px; line-height: 26px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">1. Your resume is about your skills, not about you. Of course, the resume is about why you’re great for the role. But be careful that the resume is about what skills you bring to the table, and not what you want to get out of the role.</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 16px 0px 26px; border: 0px; line-height: 26px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">　　1.简历是你能力的体现，不是用来描述个人情况的。你的简历虽然用来说明你是最符合目标职位的人选，但是你应该在其中罗列你的技能，而不是写这个职位能给你带来什么好处。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 16px 0px 26px; border: 0px; line-height: 26px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">　　2. Less is more. In order to craft a marketable resume, be ruthless in editing your resume. Don’t use blocks of text; use bullet points. Don’t make someone do a lot of reading, because they won’t. Anything that doesn’t sell you as an awesome candidate should be cut.</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 16px 0px 26px; border: 0px; line-height: 26px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">　　2.精简为佳。为了写出一份有“市场需求&quot;的简历，你必须狠下心把无关的优势都去掉。不要长篇大论，应用简短的句子描述。不要让看你简历的人像看文章一样“阅读”，因为他们不会花那么多时间这样做。只要跟你目标职位无关的亮点，全部都不应该写。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 16px 0px 26px; border: 0px; line-height: 26px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">　　3. Learn new skills. If you’re currently unemployed, take the time to learn a new skill that’s related to your career and document it on your resume. If there’s a certificate you’ve been meaning to get, take the course and earn the certification. It will make you that much more competitive.</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 16px 0px 26px; border: 0px; line-height: 26px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">　　3.学习新技能。如果你现在还没找到工作，花点时间学习与你职业规划相关的技能，并把它们写在简历上。如果你一直都想考个证，就报班争取拿到证书。这会让你在求职中更有竞争力。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 16px 0px 26px; border: 0px; line-height: 26px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">　　4. Tap into your network. Now is the time to draw on your formal and informal network — Facebook, Twitter and elsewhere. Remember, a marketable resume is good only when you have a market for it.</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 16px 0px 26px; border: 0px; line-height: 26px; color: rgb(102, 102, 102); font-family: 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">　　4.利用人脉。现在就是你利用关系网的时候了——脸谱网、推特等等。记住，一份优秀的简历只有在被人欣赏的情况下才能称得上好简历。</p><p><br/></p>', '2013-12-06 17:30:09');
