INSERT INTO `agency_teacher` VALUES ('4028816c42b221ab0142b22e9c260001', '王朝阳', '4028816c42b0eca60142b1284007000a', '/userfiles/4028816c42b0eca60142b1284007000a/images/20130609142035813581.jpg', '18900707696', '394925967', 'jiangwei@163.com', '1', '会计从业，职业资格认证等课程', '<p><span class=\"Apple-tab-span\" style=\"white-space: pre;\"></span><span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 11.818181991577148px; line-height: 25px;  background-color: rgb(255, 255, 255);\">湖南大学会计学院硕士，高级会计师、讲师，现任职于某财经类院校，所授课程深受学生喜欢，多次被评为优秀课程；长期从事会计证、会计职称等相关培训，对会计证、会计职称考试的出题点和题型有相当深入的研究，有丰富的教学经验；发表教改科研论文数篇，参编相关教材2部，曾荣立省三等功1次</span></p>', '2013-12-02 15:21:08');
INSERT INTO `agency_teacher` VALUES ('4028816c42c700c10142c706f2720000', '杨 凡', '4028816c42c0dc420142c18ab49b0000', '/userfiles/4028816c42c0dc420142c18ab49b0000/images/2013128172723.jpg', '', '', '', '1', '雅思写作、阅读', '<p><span style=\"color: rgb(102, 102, 102); font-family: 宋体, &#39;Lucida Grande&#39;, Verdana, Lucida, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 25px;  background-color: rgb(255, 255, 255);\">杨凡 “雅思五虎将” “写作四大天王” 京城雅思第一人</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体, &#39;Lucida Grande&#39;, Verdana, Lucida, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 25px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体, &#39;Lucida Grande&#39;, Verdana, Lucida, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 25px;  background-color: rgb(255, 255, 255);\">【主讲】雅思写作、阅读</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体, &#39;Lucida Grande&#39;, Verdana, Lucida, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 25px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体, &#39;Lucida Grande&#39;, Verdana, Lucida, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 25px;  background-color: rgb(255, 255, 255);\">【特色】独创的“四要素作文法”、“模板式写作法”、“双向式阅读法”，被誉为“京城雅思第一人”。&nbsp;</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体, &#39;Lucida Grande&#39;, Verdana, Lucida, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 25px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体, &#39;Lucida Grande&#39;, Verdana, Lucida, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 25px;  background-color: rgb(255, 255, 255);\">【经历】北京大学硕士。曾在加拿大、美国生活多年。数年来一直从事雅思教学研究工作。</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体, &#39;Lucida Grande&#39;, Verdana, Lucida, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 25px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体, &#39;Lucida Grande&#39;, Verdana, Lucida, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 25px;  background-color: rgb(255, 255, 255);\">【著作】《杨凡英语学习丛书》、《事半功倍打好基础-雅思词汇速记》</span></p>', '2013-12-06 16:29:50');
INSERT INTO `agency_teacher` VALUES ('4028816c42c700c10142c7080a5a0001', '祁连山', '4028816c42c0dc420142c18ab49b0000', '/userfiles/4028816c42c0dc420142c18ab49b0000/images/teacher02.jpg', '', '', '', '2', '雅思基础阅读精讲班\r\n雅思强化阅读精讲班\r\n雅思阅读单项提高班\r\n托福强化阅读精讲班', '<p><span style=\"color: rgb(102, 102, 102); font-family: 宋体, &#39;Lucida Grande&#39;, Verdana, Lucida, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 25px;  background-color: rgb(255, 255, 255);\">祁连山 “雅思五虎将” “雅思大山”</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体, &#39;Lucida Grande&#39;, Verdana, Lucida, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 25px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体, &#39;Lucida Grande&#39;, Verdana, Lucida, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 25px;  background-color: rgb(255, 255, 255);\">【主讲】雅思基础阅读精讲班</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体, &#39;Lucida Grande&#39;, Verdana, Lucida, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 25px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体, &#39;Lucida Grande&#39;, Verdana, Lucida, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 25px;  background-color: rgb(255, 255, 255);\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;雅思强化阅读精讲班</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体, &#39;Lucida Grande&#39;, Verdana, Lucida, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 25px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体, &#39;Lucida Grande&#39;, Verdana, Lucida, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 25px;  background-color: rgb(255, 255, 255);\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;雅思阅读单项提高班</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体, &#39;Lucida Grande&#39;, Verdana, Lucida, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 25px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体, &#39;Lucida Grande&#39;, Verdana, Lucida, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 25px;  background-color: rgb(255, 255, 255);\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;托福强化阅读精讲班</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体, &#39;Lucida Grande&#39;, Verdana, Lucida, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 25px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体, &#39;Lucida Grande&#39;, Verdana, Lucida, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 25px;  background-color: rgb(255, 255, 255);\">【特色】授课妙趣横生中彰显智慧、激情四射中蕴含哲理</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体, &#39;Lucida Grande&#39;, Verdana, Lucida, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 25px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体, &#39;Lucida Grande&#39;, Verdana, Lucida, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 25px;  background-color: rgb(255, 255, 255);\">【经历】北京大学硕士，雅思和托福考试“阅读大山”，美国托福考试官方机构ETS资格认证教师，现任北京环球雅思北美考试院院长。独门秘技“无词阅读法”帮助了莘莘学子成功踏上了飞跃重洋之路。著有《雅思无词阅读法》、《雅思阅读807词汇》等畅销图书.</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体, &#39;Lucida Grande&#39;, Verdana, Lucida, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 25px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体, &#39;Lucida Grande&#39;, Verdana, Lucida, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 25px;  background-color: rgb(255, 255, 255);\">【著作】《无词阅读法》《雅思阅读807词汇》</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体, &#39;Lucida Grande&#39;, Verdana, Lucida, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 25px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体, &#39;Lucida Grande&#39;, Verdana, Lucida, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 25px;  background-color: rgb(255, 255, 255);\">【大山导航】最大的快乐就是将自己的快乐与学生们分享，最大的幸福就是能享受下午的阳光，最大的追求就是能够让心情永远的自由飞翔。</span></p>', '2013-12-06 16:31:02');
INSERT INTO `agency_teacher` VALUES ('4028816c42c700c10142c708c8e70002', '王 陆', '4028816c42c0dc420142c18ab49b0000', '/userfiles/4028816c42c0dc420142c18ab49b0000/images/pic03.jpg', '', '', '', '', '雅思强化口语\r\n雅思精讲口语\r\n剑桥雅思7口语真题解析班\r\n雅思听力高分现场班', '<p><span style=\"color: rgb(102, 102, 102); font-family: 宋体, &#39;Lucida Grande&#39;, Verdana, Lucida, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 25px;  background-color: rgb(255, 255, 255);\">特色】创造“妙语连珠”雅思口语。准确把握雅思考试信息，成功预测百场考试。</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体, &#39;Lucida Grande&#39;, Verdana, Lucida, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 25px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体, &#39;Lucida Grande&#39;, Verdana, Lucida, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 25px;  background-color: rgb(255, 255, 255);\">&nbsp;&nbsp; 【经历】“雅思王”王陆老师 ，毕业于北京外国语大学应用语言学专业硕士。现任英语三一学院及北京教育考试院口语等级考试中国考官。在雅思教学领域颇有建树，擅长听力及口语，口语教学针对性强，对应试口语教育和基础口语教育都有独到的方法，创造了“妙语连珠”雅思口语。准确把握雅思考试，为学生提供针对性训练，被广大考生成为“雅思王”。</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体, &#39;Lucida Grande&#39;, Verdana, Lucida, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 25px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体, &#39;Lucida Grande&#39;, Verdana, Lucida, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 25px;  background-color: rgb(255, 255, 255);\">【著作】《王陆807词汇》、《剑桥雅思7真题解析》</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体, &#39;Lucida Grande&#39;, Verdana, Lucida, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 25px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体, &#39;Lucida Grande&#39;, Verdana, Lucida, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 25px;  background-color: rgb(255, 255, 255);\">【座右铭】Nobody&nbsp;&nbsp;can beat you，but yourself</span></p>', '2013-12-06 16:31:51');
INSERT INTO `agency_teacher` VALUES ('4028816c42c700c10142c7096d550003', '卢峭梅', '4028816c42c0dc420142c18ab49b0000', '/userfiles/4028816c42c0dc420142c18ab49b0000/images/teacher01%20(1).jpg', '', '', '', '', '雅思听力', '<p><span style=\"color: rgb(102, 102, 102); font-family: 宋体, &#39;Lucida Grande&#39;, Verdana, Lucida, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 25px;  background-color: rgb(255, 255, 255);\">卢峭梅 “听力秀手” “双向听力名师”</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体, &#39;Lucida Grande&#39;, Verdana, Lucida, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 25px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体, &#39;Lucida Grande&#39;, Verdana, Lucida, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 25px;  background-color: rgb(255, 255, 255);\">【主讲】雅思听力</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体, &#39;Lucida Grande&#39;, Verdana, Lucida, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 25px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体, &#39;Lucida Grande&#39;, Verdana, Lucida, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 25px;  background-color: rgb(255, 255, 255);\">【特色】弦外之音，一枝独秀。</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体, &#39;Lucida Grande&#39;, Verdana, Lucida, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 25px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体, &#39;Lucida Grande&#39;, Verdana, Lucida, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 25px;  background-color: rgb(255, 255, 255);\">【经历】北京师范大学英语语言学硕士。曾在美国从事口译工作2年多。目前是剑桥英语口语等级考试中国区考官，英国剑桥商务英语等级BEC中国区考官，“双向听力法”创始人，有近十年的托福雅思教学和研究经验，是深受广大学生喜爱的学者型雅思实战教师！</span><br style=\"color: rgb(102, 102, 102); font-family: 宋体, &#39;Lucida Grande&#39;, Verdana, Lucida, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 25px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(102, 102, 102); font-family: 宋体, &#39;Lucida Grande&#39;, Verdana, Lucida, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 25px;  background-color: rgb(255, 255, 255);\">&nbsp;&nbsp; 【著作】《卢峭梅双向听力法》、《卢峭梅讲雅思听力机经》</span></p>', '2013-12-06 16:32:33');
INSERT INTO `agency_teacher` VALUES ('4028816c42d4dd790142d4f424d00003', '申骏', '4028816c42b0eca60142b1284007000a', '/userfiles/4028816c42b0eca60142b1284007000a/images/20120921103115261526.jpg', '', '', '', '2', '', '<p><span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 11.818181991577148px; line-height: 25px;  background-color: rgb(255, 255, 255);\">申骏，湖南某高校英语教研室主任，主讲基础英语及大学英语课程，多年来主要从事大学英语四、六级的辅导培训工作，能够准确地把握四六级的难度，针对四六级题型的阶梯思路和解题技巧总结了一定的规律，深受学员喜爱。</span></p>', '2013-12-09 09:23:59');
INSERT INTO `agency_teacher` VALUES ('4028816c433c178101433c48076e0001', '梅世强', '4028816c42fe72200142fe858ed70000', '/userfiles/4028816c42fe72200142fe858ed70000/images/jg1.jpg', '18900707696', '394825', '394925967@qq.com', '1', '一建工程', '<p><span style=\"font-family: Simsun; font-size: medium;  background-color: rgb(255, 255, 255);\">梅世强，天津大学管理学院管理系教授，全国一级建造师执业资格考试大纲、考试用书编委，我们的名师团队核心成员，研究方向为项目管理、工程造价管理，工程咨询以及房地产开发与经营，著作颇丰。授课时能够把难懂的工程经济的知识讲得浅显易懂，命中率非常高，被广大学员和考生高度认可，是国内工程经济讲得最好的老师！ 主讲课程：一级建造师《建设工程经济》科目。</span></p>', '2013-12-29 10:56:30');
INSERT INTO `agency_teacher` VALUES ('4028816c445260d00144528256ea0005', '钟君', '4028816c445260d0014452778a730003', '/userfiles/4028816c445260d0014452778a730003/images/022104.jpg', '', '', '', '1', '申论', '<p>中国社科院博士，副教授，硕士生导师；华图教育首席研究与培训专家，公职培训行业申论教学体系开创者；独创申论写作“万能八条”，成为行业培训引用典范，出版《申论万能宝典》、《申论范文宝典》，出版以来，稳居同类图书销售榜首，公职考试考生接近人手一册。<br/><br/>多次命中国家及地方公务员考试申论试题，各大媒体的特邀公考专家。</p><p><br/></p>', '2014-02-21 11:34:37');
INSERT INTO `agency_teacher` VALUES ('4028816c445260d001445284b82b0006', '章晓铭', '4028816c445260d0014452778a730003', '/userfiles/4028816c445260d0014452778a730003/images/022105.jpg', '', '', '', '', '言语理解与表达', '<p>公务员考试资深研究专家，北京大学硕士。从事多年的公务员考试命题的研究，对公务员考试形式和试题把握精准，对言语理解与表达、判断推理、常识判断等有深入的研究。专业基础扎实，功底深厚，讲授方法独到，条理清晰、幽默易懂，系统脉络中显吉光片羽。先后培训学员有几万人且效果显著，深受广大学员推崇。</p><p><br/></p>', '2014-02-21 11:37:13');
INSERT INTO `agency_teacher` VALUES ('4028816c445260d001445285a8480007', '刘有珍', '4028816c445260d0014452778a730003', '/userfiles/4028816c445260d0014452778a730003/images/022106.jpg', '', '', '', '', '数量关系与资料分析', '<p>毕业于北京师范大学，先后担任过中学教师，奥数教师，硕士毕业后加入华图教育，自此之后，开始了全国的巡回上课，坚信优秀的老师一定要了解学生、灵活运用教学方法；一定要学会倾听，倾听自己的课堂。在课堂上，学会了真正倾听学员的心声，从学员们真正的学习需要出发，组织教学。</p><p><br/></p>', '2014-02-21 11:38:14');
INSERT INTO `agency_teacher` VALUES ('4028816c445260d00144528703540008', '刘子丰', '4028816c445260d0014452778a730003', '/userfiles/4028816c445260d0014452778a730003/images/022107.jpg', '', '', '', '', '判断推理', '<p>考试研究中心研究员，西南政法大学硕士研究生。热爱逻辑学，具有扎实的专业知识，长期从事公务员判断推理模块的研究。独特的授课模式，让学员在轻松愉快的氛围中快速掌握枯燥的逻辑知识，并将其转化成强大的应试能力，帮助学员迅速提高应试成绩</p>', '2014-02-21 11:39:43');
