INSERT INTO `course_package` VALUES ('4028816c4490b94c014490ba470a0000', null, '1212121', '2121.00', '2121.00', '<p>介绍</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; font-size: 12px; list-style: none;\">全科VIP班由该考试基础+所报专业科目的精讲班、冲刺班、习题班、考点预测班、应试技巧班、模考押题班等班别组合而成，适用于任何学习阶段的学员。该班级通过对教材知识系统详细地讲解、考纲及重点难点的分析、历年真题及模拟题的深度解析、复习方法及考试技巧的介绍等教学内容，使学员全面掌握考试，最后会配有主讲老师的两套预测题供学员练习参考。课程有效期：2014年考试结束后关闭（有效期暂以2013年为准）</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 8px 0px; font-size: 12px; list-style: none;\">2014年班级参考2013年班级进行设置，2014年新版课程会根据教材变化及学员反馈情况进行更新课程，保留或更改班级设置、课时及授课老师。</p><p><br/></p>', '212', null, '2014-03-06 11:30:01', '2014-03-05 13:32:10', 'jiangwei3457', 'jiangwei3457', '4028816c42c0dc420142c18ab49b0000', '210000', '4028816c40a002bf0140a00360720003', '', '4028816c4462851f01446288b6ec0000,4028816c4462745f0144627593820000,4028816c42c66c880142c68568270007,4028816c42c66c880142c68442640006,4028816c42c66c880142c681fb330005,4028816c42c66c880142c680374b0004', '', '21212211111111111111111111111', '1');
