DROP TABLE IF EXISTS `agency`;
CREATE TABLE `agency` (
  `id` varchar(32) NOT NULL COMMENT '主键ID',
  `name` varchar(255) DEFAULT NULL COMMENT '公司名称',
  `abbreviation` varchar(500) DEFAULT NULL COMMENT '公司简称',
  `provinceID` varchar(32) NOT NULL COMMENT '所在省份',
  `cityID` varchar(32) DEFAULT NULL COMMENT '所在城市',
  `areaID` varchar(32) DEFAULT NULL COMMENT '所在地区',
  `keywords` varchar(255) DEFAULT NULL COMMENT '关键字',
  `category` varchar(255) DEFAULT NULL COMMENT '培训类别',
  `address` varchar(255) DEFAULT NULL COMMENT '公司地址',
  `officephone` varchar(50) DEFAULT NULL COMMENT '办公电话',
  `fax` varchar(30) DEFAULT NULL COMMENT '传真',
  `introduction` text COMMENT '公司简介',
  `create_time` datetime DEFAULT NULL COMMENT '注册时间',
  `content` varchar(32) NOT NULL COMMENT '备注',
  `status` varchar(4) DEFAULT NULL COMMENT '0:未处理 1:已处理',
  `image_url` varchar(250) DEFAULT NULL COMMENT '机构LOGO',
  `second_domain` varchar(32) DEFAULT NULL COMMENT '二级域名',
  PRIMARY KEY (`id`),
  UNIQUE KEY `IDX_AGENCY` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

