-- ----------------------------
-- Procedure structure for `search`
-- ----------------------------
DROP PROCEDURE IF EXISTS `search`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `search`(
 in _pagecurrent int,/*当前页*/
 in _pagesize int,/*每页的记录数*/
 in _ifelse varchar(1000),/*显示字段*/
 in _where varchar(1000),/*条件*/
 in _order varchar(1000)/*排序*/
)
    COMMENT '分页存储过程'
BEGIN
 if _pagesize<=1 then 
  set _pagesize=20;
 end if;
 if _pagecurrent < 1 then 
  set _pagecurrent = 1; 
 end if;
 
 set @strsql = concat('select ',_ifelse,' from ',_where,' ',_order,' limit ',_pagecurrent*_pagesize-_pagesize,',',_pagesize); 
 prepare stmtsql from @strsql; 
 execute stmtsql; 
 deallocate prepare stmtsql;
 set @strsqlcount=concat('select count(1) as count from ',_where);/*count(1) 这个字段最好是主键*/
 prepare stmtsqlcount from @strsqlcount; 
 execute stmtsqlcount; 
 deallocate prepare stmtsqlcount; 
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `sp_page`
-- ----------------------------
DROP PROCEDURE IF EXISTS `sp_page`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_page`(
 in _pagecurrent int,/*当前页*/
 in _pagesize int,/*每页的记录数*/
 in _ifelse varchar(1000),/*显示字段*/
 in _where varchar(1000),/*条件*/
 in _order varchar(1000)/*排序*/
)
    COMMENT '分页存储过程'
BEGIN
 if _pagesize<=1 then 
  set _pagesize=20;
 end if;
 if _pagecurrent < 1 then 
  set _pagecurrent = 1; 
 end if;
 set @strsql = concat('select ',_ifelse,' from ',_where,' ',_order,' limit ',_pagecurrent*_pagesize-_pagesize,',',_pagesize); 
 prepare stmtsql from @strsql; 
 execute stmtsql; 
 deallocate prepare stmtsql;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `stu_order`
-- ----------------------------
DROP PROCEDURE IF EXISTS `stu_order`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `stu_order`(
 in _stuid VARCHAR(32)/*学员ID*/
)
    COMMENT '学员订单'
BEGIN
 select * from f_order_main as o where o.stu_id=_stuid and o.order_status=1;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `test`
-- ----------------------------
DROP PROCEDURE IF EXISTS `test`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `test`(IN keywords varchar(200))
begin
select * from agency_course a WHERE a.coursename =keywords;
 end
;;
DELIMITER ;
DROP TRIGGER IF EXISTS `truComment`;
DELIMITER ;;
CREATE TRIGGER `truComment` AFTER INSERT ON `course_comments` FOR EACH ROW BEGIN             
         Update  agency_course as a inner join (select courseid ,count(*) as number from course_comments group by courseid )  as b on a.id = b.courseid   
					set a.commentcount=b.number;    
       end
;;
DELIMITER ;
